  (1800,1581,1580,NULL,54,1,12,NULL,'2012-11-28 18:41:43','Comentarios del cliente:\n\n1. Se puede aadir una o dos interruptores de luz en la pared?\n\n2. Sera posible que los altavoces ms lejos/ adelante de la televisin? Estamos promoviendo la idea de los altavoces inalmbricos y si estn al lado de la TV , no significaria mucho. \nQuizs solo  ms a la izquierda y a la derecha, en el otro lado de de los cajones?\n\n3. Adems,  los auriculares del ordenador porttil no pueden ver muy bien. Puedrian ser ms visibles?\n\nGRacias\n\n******************************************************\n\n1. Can you add one or two light switches on the wall?\n2. Would it be possible for the speakers to be further from the TV? We are promoting the idea of wireless speakers and if they are right next to the TV then wireless doesnt mean much. Just perhaps further to the left and right on the other side of of the drawers?\n3. Also, I cant see the headphones by the laptop PC very well. Can they be more visible?','2012-11-28 18:41:43',NULL,'2012-11-28 18:41:43',NULL),
