  (1832,1831,1831,NULL,38,6,14,'Comentarios del cliente','2012-11-29 13:26:09','Somos una empresa de gestin de viajes, con sede en Sydney - Australia. Nuestros clientes son una mezcla de:\n\n-Viajeros Corporativos / negocios\n- Viajeros de vacacionales Luxury \n\nNuestra filosofa es la de \"ver las cosas de otra manera\" y nuestro objetivo es hacer que el proceso de organizacin de viajes para el cliente sea simple  .\n\nEstamos buscando crear un diseo de procesador de texto para nuestro documento de propuesta de negocio que se utilizara como un argumento de promocin para nuevos clientes potenciales.\n\nEl contenido ha sido escrito y su tarea ser la de crear el diseo y luego formatear el contenido existente en el documento.\n\nPara que el documento no tenga que ser personalizado para cada cliente nuevo, la plantilla de diseo deber tener una forma sencilla de llenar:  el nombre del cliente potencial (por ejemplo, una opcin de relleno automtico).\n\nGracias\n\n*************************************************+\nWe are a boutique travel management company based in Sydney. Our clients are a mix of:\n\n-Corporate travellers/businesses\n-Luxury holiday travellers\n\nOur philosophy is to \"look at things differently\" and we aim to make the process of travel arranging simple for the client.\n\nJob Description: \nWe are looking for a talented Designer to create a word document design for our Business Proposal document which is used as a promotional pitch to potential new clients.\n\nThe content has been written and your task will be to create the design and then format the existing content into the document.\n\nAs the document will need to be personalised for each new client, the template you design will have a simple way of filling in the potential client''s name (eg. an autofill).','2012-11-30 16:25:18',NULL,'2012-11-29 13:26:09',NULL),
