  (1838,1832,1831,NULL,48,6,12,NULL,'2012-11-29 13:55:17','Comentarios del cliente:\n\nHe adjuntado el documento Word que me gustara ''renovar'' en algo ms profesional. Es un documento que se presenta a los posibles nuevos clientes. Te dars cuenta de que a lo largo del documento se encuentran las palabras [Nombre de la Compaa] resaltados en amarillo. \n\nEstos son lugares que insertar el nombre de la empresa que est enviando el documento.\n\nPor favor vea el siguiente enlace de nuestro sitio web que est a punto de ser relanzado. Si el diseo del documento podra ser en un estilo similar a nuestro sitio web, sera genial. \n\nhttp://www.gensofts.info/projects/frontier-trav ...\n\nGracias\n\n***********************************************\nI have attached the document that I would like ''refreshed'' into something more professional. It is a document that we present to potential new clients. You will notice that throughout the document there are the words [Business Name] highlighted in yellow. These are places that we insert the name of the company we are sending the document.\n\nOur website is about to be relaunched and here is the link to what the site will look like. If you document design could be in a similar style, that would be great. Here is the link to the test site: \n\nhttp://www.gensofts.info/projects/frontier-trav...','2012-11-29 13:55:17',NULL,'2012-11-29 13:55:17',NULL),
