  (1840,1685,1683,NULL,46,1,12,NULL,'2012-11-29 14:05:09','Rommel:\nDale prioridad a esto por favor.\nSi alguno de los comentarios no esta claro o tomara mucho tiempo primero discutirlo conmigo.\n\nCorrecciones del cliente:\n1. La isla de la cocina debe eliminarse.\n2. Ver la posibilidad de recorrer hacia adelante, la columna del living que colinda con la terraza  para dejar la esquina libre dando la posibilidad de que las puertas puedan correrse a ambos lados. Se puede usar paos que se recorran totalmente.\n3. La ubicacin de la puerta del bao de visita, considero debe estar a lado de las gradas tal vez un poco metida, para que en ese espacio de pasillo muerto sea el espacio donde se bata.\n4. Mover la columna del ingreso hasta que coincida con la baranda de la sala de estar y para no reducir el espacio del living, que esta columna solo sea internamente hasta la altura de la puerta. Mantenindose la columna que colinda con las gradas tal como esta.','2012-11-29 14:05:09',NULL,'2012-11-29 14:05:09',NULL),
