  (1871,1781,1780,NULL,48,6,12,NULL,'2012-11-29 19:47:32','Cometarios del cliente:\n\nAcabo de revisar los logos y tal vez no fui especifica en mi requerimiento con respecto a la frase en letra cursiva. La frase \"a quality service company\" debe estar en letras minusculas y cursivas (como el modelo en PPT). Por eso te decia que escogieras una tipografia sencilla y legible porque necesitamos que sea viera como manuscrita, pero que sea MUY LEGIBLE. \n\nLos colores me parecen un poco encendidos (muy claros), me ayudas revisando eso tambien por favor. \nTal vez te sirvan como guia los colores de IKEA (son los mismos), te envio una imagen. \n\nGracias','2012-11-29 19:47:32',NULL,'2012-11-29 19:47:32',NULL),
