  (2080,1581,1580,NULL,54,1,12,NULL,'2012-12-06 08:51:46','Comentarios del cliente:\n\n1. Crees que el control remoto y el juego se pueden ubicar sobre la mesa para este viernes? Necesito el grfico.\n\n2. Soy yo o es la perspectiva de la habitacin? Pero, la televisin se ve pequea en comparacin a la computadora  y los auriculares. Podrias asegurarte de que todo este bien?\n\nGracias\n\n**************************************************\n\n1. Do you think the remote and gaming controller can be done and placed on the table by Friday? I need the graphic to make a sign.\n\n2. Is it me or is the perspective in the room off? The TV looks small compared to the computer and headphones. Can you be sure everything is right in that regard?','2012-12-06 08:51:46',NULL,'2012-12-06 08:51:46',NULL),
