  (2085,1832,1831,NULL,48,6,15,NULL,'2012-12-06 10:14:33','Comentarios del cliente:\n\nHe echado un vistazo a los documentos y  no es realmente lo que yo haba imaginado. Tena en mente un cambio de formato ms significativo de lo que es el documento existente. El proyecto de documento es efectivamente un cambio de colores.\n\nTe invitamos a cambiar el diseo de la primera pgina todo lo que quieras. La imagen de la montaa no no es necesario qu se mantenga, si puedes crear algo ms interesante. \n\nDel mismo modo, la disposicin del texto en las otras pginas no necesita quedarse tal como est,  puedes modificarlo para que sea ms creativo.\n\nLas bandas que se encuentran en el encabezado y el pie de pgina, preferira que sean verticales, en lugar de en el encabezado y pie de pgina. \n\nLos encabezados y pies de pgina no se imprimen bien, y la alineacin de la parte inferior del cuadro verde y la lnea horizontal negro no armonizan.\n\nEn el pie de pgina, no me gusta el cuadro blanco -  recuadro -  donde est escrito \"Propuesta de Viajes de Negocios\" y \"Nombre del Negocio\".\n\nTal vez puedas hacer \"cajas caractersticas\" en algunas pginas donde yo pueda escribir puntos clave sobre un tema en particular.\n\nGracias\n\n*********************************************\n\nI''ve had a look at the document and it isn''t really what I had imagined. I had in mind a more significant format change than what the existing document is. The draft document is effectively a change of colours.\n\nYou are welcome to change the design of the first page as much as you like. The image of the mountain does not need to stay if you can create something more interesting. Similarly, the layout of the text on the other pages does not need to stay as it is and you can modify it to be more creative.\n\nI would prefer the bands that are in the header and footer of the draft document to be vertical on the page, rather than in the header or footer. The headers and footers don''t print well, and the alignment of the bottom of the green header box and the horizontal black line doesn''t match. In the footer, I don''t like the white inset box where the \"Business Travel Proposal\" and \"Business Name\" is written. \n\nPerhaps make ''feature boxes'' on some pages where I can write key points about a particular topic.','2012-12-06 10:19:08',NULL,'2012-12-06 10:14:33',NULL),
