  (2104,1912,1790,NULL,48,6,12,NULL,'2012-12-07 08:28:43','Comentarios del cliente:\n\nGracias por el diseo, agradezco el esfuerzo. Sin embargo, esta realmente muy lejos de la muestra que te di: \n\nhttp://www.athleticgreens.com.\n\nPor favor, mira ms de cerca esta pagina y usa esos elementos de diseo.\n\nEn general, los botones tienen que ser ms grande y salir. El formulario de pedido debe estar en la parte superior derecha y en la parte de abajo del formulario de pedido, debe decir \"RUSH MY ORDER\" (es necesario disear ese botn tambin).\n\nDe hecho, por favor copia el formato del Athletic Greens site.  Adjunto un documento con comentarios ms especficos.\n\nGracias\n\n************************************************************************\n\n\nThank you for the design. I appreciate the effort however it is really far from the sample site we gave you http://www.athleticgreens.com .\n\nPlease look more closely at https://www.athleticgreens.com and use those design elements. \n\nIn general the buttons need to be bigger and pop out. The order form should be on the top right and below the order form it should say RUSH MY ORDER (you need to design that button). \n\nIn fact please copy the format of the Athletic Greens site. \nSee attached for more specific comments.','2012-12-07 08:28:43',NULL,'2012-12-07 08:28:43',NULL),
