  (2156,2155,2155,NULL,48,6,14,'Mensaje del cliente:','2012-12-12 16:05:57','Esta es una postal de 5x7 para un consultorio dental con 3 locaciones  y necesito que un lado este en espaol y el otro lado en ingls.\nVoy a tener otros proyectos para darte a medida que avancemos, y espero que con el tiempo se sepas mejor lo que busco. \nEste diseo es para alguien muy elegante y  de clase alta. Ellos tienen grandes problemas de servicio al cliente y quiero hacer un anuncio publicitario para enviar a los clientes anteriores que dice:\nIt is a new year, you have new benefits and now you can have the perfect smile to make that perfect first impression.\n(Me puedes ayudar traducindolo al espaol,  algo que se conecte a la poblacin mexicana en California,  sera genial). \nEl correo electrnico de abajo es nuestro diseo web y lo que estamos construyendo ahora. Las notas son de mi parte para cambiar el diseo existente para que sea \"ms bonito\", ms suave y acogedor. \nSe van a comprar algunas fotos en la web en shutterstock,  si requieres alguna, por favor avsame. mi nombre de usuario es: ocdental  y la contrasea es: \"theet\" Esto tambin te dar una mejor idea de mi. \nMe enviaste un ejemplo de tu trabajo sobre dientes, me gustara algo as, grande en un color naranja oscuro mezclado con otros colores. Vivimos en el condado de Orange y todas las locaciones se encuentran en el mismo condado.\nTambin necesito el logo que es SONRISA OC -  te enviare una invitacin a Drop box  para que puedas ver las oficinas y tener acceso al logotipo.\n As que bsicamente lo que necesito es:\nUn volante (5x7)\n \nPara los clientes existentes o clientes que no volvieron ms, pero todos ellos han estado aqu por lo menos una vez. \nCada ao, el seguro que tiene la gente comienza a principios de enero y termina el 31 de diciembre. Si ellos no utilizan el seguro, lo pierden. \nMuchas personas perdieron sus beneficios el ao pasado porque nunca fueron al dentista, y muchos lo utilizaron y se fueron por que no tenan suficiente para terminar el trabajo. \nQueremos que los que no terminaron el trabajo, vengan con nuevas prestaciones para terminar el trabajo y los de los que nunca se hicieron un trabajo y lo perdieron  no lo  pierdan de nuevo este ao. Manos a la obra desde principios del ao  para tener una sonrisa perfecta.\n De alguna manera tengo que expresar todo eso,  pero bsicamente:\nNew Year, new you, great smile\n.y lo ms importante que quiero decir es:\nNew Year, new you and NEW US! Come and see us now and make the most of your benefits. \nEn cuanto al diseo, por favor recuerda que debe ser elegante, fancy y de primer nivel. \nMe gusta el diente en tu muestra, tambin encontr otro que me gust  en shutterstock, que es similar pero con filigrana... tal vez algo as????\nEspero que esto te ayude a entender  lo que quiero y luego traducirlo al espaol! \n Puedes ponerte en contacto conmigo en el correo electrnico cada vez que se necesites.\n\n********************************\nThis post card I need is a 5x7 post card for a dental office with 3 locations and I need one side to be in Spanish and the other side to be in English.\n I will have other projects to give you as we move along and hopefully over time you will know better what I mean when I ask for certain looks.\n This client is very elegant and very high class. They have major customer service issues and I want to make a mailer to send to past customers that says it is a new year, you have new benefits and now you can have the perfect smile to make that perfect first impression. (If you can help me do the Spanish side to something that will connect to the Mexican population here in California, it would be great.)\n The email below is our web design and what we are building now. The notes are from me to change the existing design to make it \"prettier\", softer, and welcoming.\n The web person will be buying some shutter stock photos so if you want any, let me know. My shutter stock account is username: ocdental/paswd: \"teeth\"\nThis should also give you a better understanding of my look and feel.\n You had a sample you sent me for teeth that you had done- something like that would be great in a dark orange color mixed with other colors. We live in ORANGE county and all locations are in the same county.\n Also the logo I need is OC SMILE - I will also send you an invitation to drop box so you can see what the offices look like and access the logo.\n So basically I need:\nA flyer (5x7) \nFor existing customers or past customer who are not coming anymore- but they all have been here at least once \nEvery year the insurance that people have starts again at the beginning of January and ends in December 31. If they dont use the insurance, they lose it. Many people lost their benefits last year because they never went to dentist, and many used it and ran out and did not have enough to finish their work. We want the ones that did not finish, coming back with new benefits and finishing their work and the ones that never came and lost it - to no lose it again this year and get on it very early in the year and get a perfect smile.\n \nSomehow I need to say al that- but basically New Year, new you, great smile and most important I want to say New Year, new you and NEW US! Come and see us now and make the most of your benefits....\n I have rambled on sorry- I will get better at what you need and how you work- but for now I had no idea of more or less is better for you.\n As far as design- please remember elegant, fancy, upscale. I like your tooth on your sample; I found one I liked on shutter stock that is similar but with filigree...maybe something like that????\n Let me know if this helped and hope you can make sense out of what I want and then turn it into Spanish!!! Hahahaha! \nI am around. You can reach me on email whenever you need.','2012-12-12 16:05:57',NULL,'2012-12-12 16:05:57',NULL),
