  (2167,2166,2166,NULL,48,6,14,'Mensaje del cliente:','2012-12-17 16:48:45','Parte de la informacin:\n\n1) El diseo debe ser diferente al anterior.\n\n2) Todava no s el nombre del proyecto, por ahora usa \"Grupo Feldmeier\", tal vez mas adelante te pida que lo cambies simplemente, o tal vez se quede como est. Tal vez  puedas incluir algn logotipo o simplemente ve lo que sea mejor para el diseo.\n\n3) El slogan para el sitio web es : Knowledge is power\n\n4) Debe disear la pgina principal con la posibilidad de que al hacer click en  open plan calculator, se pase a  una calculadora de plan como el que esta en el sitio web que djunte como \"-home-page-swich example.zip\".\n\n5) Usted ve que hay grfico de la calculadora de plan, el asunto es que es ejemplo deeste sitio web:  http://iretvaipirkt.lv/lv/ , parece que han utilizado : JavaScript http://www.highcharts.com , as que cuando ests diseando por favor toma  el ejemplo de : highcharts.com  y ver si seria posible codificarlo.\n\n6) Utilice unas fotos con estilo de negocios en la pgina web.\n\n7) Se puede disear favicon tambin esta vez?\n\n8) As como antes los requisitos son los siguientes:\n\n NEGOCIO DE SITIO WEB DEL ESTILO\n MUY PROFESIONAL\n MINIMAL / RESERVADO ESTILO\n ALTA CALIDAD\n Colores gris, azul, oro.\n\n\nPero lo ms importante es  que liberes tu ente al disear , como tu consideres mejor  para que todo  se complemente  bien,  as que sintete libre de  pasar por alto algunas direcciones  para lograr el mejor resultado posible.\n\nGracias,\n\n***************************************************************************************\nSome information:\n\n1)\tDesign must be different like it was previous time.\n2)\tI still do not know name of project, for now use Feldmeier Group, maybe I will ask later to just change it, or maybe it will stay as it is. Maybe try to include some logo as well, or just look what will be better for design.\n3)\tSlogan for website: Knowledge is power\n4)\tYou must design main page with possibility that when you press open plan calculator it will switch to plan calculator like it on that website what is attached in home-page-swich-example.zip.\n\n5)\tYou see that there is graph in plan calculator, thing is - that it is example form this website http://iretvaipirkt.lv/lv/, and looks like they have used JavaScript from http://www.highcharts.com, so when you design graph then take the look at highcharts.com examples if it is even possible for coder to code it.\n\n6)\tUse some business style pictures in webpage.\n7)\tCan you design favicon as well this time?\n8)\tAs well like before requirements are:\n\tBUSINESS STYLE WEBSITE\n\tVERY PROFESSIONAL\n\tMINIMAL/RESERVED STYLE\n\tHIGH-QUALITY\n\tColors grey,blue, gold.\n\n\n\nBut most important thing is  free your mind and design, put each boxes like you would like and how everything would fit in design as you think, so you can ignore some things what is written to achieve best possible result.\n\nThanks,','2012-12-17 16:48:45',NULL,'2012-12-17 16:48:45',NULL),
