  (2184,2183,2183,NULL,48,6,14,'Comentarios del cliente + archivos adjuntos','2012-12-19 17:11:44','Tenemos una academia de ftbol en Bangkok, Tailandia. Este es nuestro sitio web actual: \n\nwww.targetfootballacademy.com\n\nRecientemente hemos hecho una alianza con el Real Madrid. Tenemos que redisear todo para  ser \"Real Madrid Academy\",  nuestro nuevo dominio es: \n\nwww.realmadridacademy.com\n\nHe preparado algunos archivos que muestran lo que tenemos que modificar, slo algunas imgenes en la web. Slo grficos, sustitucin de imagenes directamente, por ejemplo, cambiar el botn \"target store\" de naranja a azul.\n\nEstas son las referencias folleto: \"YPD_programme_front_reference.jpg\" \"YPD_programme_back_REFERENECE.jpg\"\n\nVoy a hacer una lista de los cambios y te los enviar, sobre todo tenemos que cambiar la obra de arte  del Barcelona al Real Madrid!\n\nVoy a necesitar tu ayuda con la bsqueda de imgenes de alta resolucin de las super estrellas del Real Madrid para utilizarlas en los folletos y banners.\n\nEstas son las imgenes utilizadas en la pgina web \"images.zip\"\n\nTarget football academy sera cambiado a target football.\n\nTarget football ,es un socio con la Fundacin Real Madrid, juntos hacemos Real Madrid Academy . En el pie de pgina que tenemos que mostrar  Real Madrid Fundation con el logotipo de Target football.\n\n\n********************************************\n\nOur company needs to re-brand. We will require a designer fluent in web, graphics and print to make changes and/or new design to our website, leaflets, posters and banners.\n\nWe have a football academy in Bangkok, Thailand. This is our current website: www.targetfootballacademy.com\n\nWe have recently made a partnership with Real Madrid. We need to rebrand everything to be ''Real Madrid Academy'',n ew domain name is : www.realmadridacademy.com\n\nI have prepared some files that show what we need to modify, only few images on the website.\n\nOnly graphics, straight image replacement, for example the ''target store'' button change from orange to blue.\n\nthese are leaflet references: \"YPD_programme_front_reference.jpg \" \"YPD_programme_back_REFERENECE.jpg \"\n\nI will make a list of changes and send you, mainly we need to change the artwork to be Real Madrid, currently its Barcelona!\n\ni will need your help with finding high resolution images of real madrid superstars to use on the leaflet and banners\n\nThese are images used on the website \"images.zip\"\n\nTarget football academy is renamed to target football\n\nTarget football is partner with real madrid foundation, together we make real madrid academy on the footer we need to display real madrid foundation with target football logo.','2012-12-19 17:11:44',NULL,'2012-12-19 17:11:44',NULL),
