  (2199,2167,2166,NULL,48,6,15,NULL,'2012-12-20 09:28:54','Comentarios del cliente:\n\nOk, vamos a redisear la pagina de inicio primero y despues la calculadora.\n\nVoy a escribir slo lo que no me gusta:\n\n1) Tal vez en lugar de tono azul se puede tratar de utilizar un gris, puedes poner gris, si no queda bien podemos volver a poner azul.\n\n2) En primer lugar, en este sitio web no habr ningn plan, as que no hay necesidad de ello :)\n\n3)  Login y Register deben estar en un solo lugar, y debe estar visible para todo el mundo, no las pongas en la parte inferior.\n\n4) Re disea el  logo,  tal vez puedes copiar algn logotipo un  Banco en Bolivia y hacer algo similar???\n\n5)  Podras  tratar de poner en el background un  rascacielos de Nueva York?\n\n6) Diseo de \"Live support\"  algo diferente a la primera vez.\n\n7) Ve la imagen adjunta, tambin hay comentarios ah.\n\n************************************\n\nOk, lets start redesign home page, then later calculator, when we will be done with this one.\n\nI will write only what I do not like:\n\n1) Maybe instead of blue tone you can try to use grey one, can you put grey, if it will not be ok we can put blue back.\n2) First in this website will be NO plans, so no need for them :)\n3) Login and Register must be in one place, and must be visible to everyone, do not put them in bottom.\n4) Redesign logo, check maybe some Bolivian bank logo and make something similar ???\n5) Can you try in background put new york skyscrapers?? \n6) Design \"Live support\" somehow different from first time.\n\n7) See the picture attached, there is also comments,','2012-12-20 09:28:54',NULL,'2012-12-20 09:28:54',NULL),
