  (2210,2167,2166,NULL,48,6,12,NULL,'2012-12-26 09:15:07','Comentarios del cliente+ imagen adjunta\n\nMe gustan los dos diseos, pero vamos a seguir con el del logotipo azul. As que,  podras guardar la imagen de las nubes, la pondr en rotacin tambin.\n\n1) Se puede disear \"mouse over\" para 1-11 ( ver imagen adjunta). Creo que \"outer glow\"estara bien tambin, pero tal vez puedas poner tu propia idea. Todo lo dems es super agradable me gusta.\n\n2) Despus puedes pasar al diseo de la calculadora, debe ser as, pero los botones y el grfico deben encajar en el diseo: http://goo.gl/xGQ9I \n\nExcluir \"Get started\" del ttulo, no es necesario.\n\n**************************************\n\nI like both designs, but lets stick with that where is blue logo. So, can you save that image where is clouds, I will put it in rotation as well.\n\n1) Can you design \"mouse over\" for 1-11, look at attached picture. I think that \"outer glow\" would be ok as well, but maybe put your own idea. Everything else is super-nice I like it.\n\n2) After this you can move to calculator design, must be like this, but buttons and graph must fit in design: http://goo.gl/xGQ9I Exclude \"Get started\" title, it is not necessary.','2012-12-26 09:15:07',NULL,'2012-12-26 09:15:07',NULL),
