  (2375,2373,2373,NULL,54,1,14,'Comentarios del cliente','2013-01-15 11:05:45','Actualmente estamos renovando por completo una casa de campo en Blgica. Nos gustara algunas nuevas ideas de diseo de interiores para el bao principal / closet. Estamos demoliendo  casi todo el interior ... as que todo es posible.\n\nBuscamos un buen boceto. Usted tendr que planificar adecuadamente distribucin de la habitacin y hacer que los elementos encajen  bien dentro de la habitacin.Ver archivos adjuntos para las mediciones.\n\nDe estos se puede construir imgenes 2D/3D de habitaciones en funcin de tus diseos y que nuestros especialistas puedan seguir. Dibujos CAD pueden ser necesarios para tamaos de tcnicos, etc\n\nEl diseo estar liderado por ideas que nos gustan a partir de fotos y sitios web que podamos sugerir. Sin embargo, el diseo es en ltima instancia de usted. Vamos a renovar la casa entera asi que  vamos a  necesitar ms diseos para la cocina, otros baos, cuartos , saln, pasillos y dormitorios.\n\nCada habitacin tiene alrededor de 2 vistas desde cada ngulo para comprender nuestras necesidades de construccin.\n\nLos productos que se utilizan deben estar fcilmente disponibles en el mercado europeo ( o el Reino Unido o EE.UU.), tales como retretes, duchas,  iluminacin, etc.\n\nGracias\n\n***************************\n\nWe are currently completely renovating a farm house in Belgium. We would like some new interior design ideas for the master bathroom/closet. We are putting almost all the interior down... so everything is possible. \n\nWe are looking for some good sketch. You will need to adequately plan room layouts and make items fit nicely within the room.\n\nSee attachments for measurements. From these you can build 2d/3d images of rooms based on your designs that our construction specialists can follow. Cad drawings may be required for technical sizes etc.\n\nThe design is led by ideas we like from photos and websites that we can suggest. However the design is ultimately down to you. We will renovate the full house so we may need more designs for the kitchen, other bathrooms, wet rooms, living room, hallways and bedrooms.\n\nEach room needs around 2 shots from each angle to understand our construction requirements.\n\nProducts that you use must be readily available in the European market (if not UK or US), such as toilets, showers, lighting etc','2013-01-15 11:05:45',NULL,'2013-01-15 11:05:45',NULL),
