  (2388,2386,2373,NULL,54,1,15,NULL,'2013-01-15 12:23:23','Mensaje del cliente:\n\nEsta casa es una segunda residencia. Vamos con nuestros 2 hijos varias veces al ao y nos reunimos con amigos y familiares all.\n\nDetalles a continuacin:\n\nLa altura antes de la renovacin se indica en el plan por ejemplo: 250 cm - Puede cambiar un poco, si es necesario puedo pedir una mejor estimacin.\n\nPara ms informacin el bao de invitados pequeo (a la izquierda del plano) desaparecer y se conviertir en una pequea oficina abierta.\n\nLa electricidad, agua caliente, fra y desage sern reconstruidas por completo, asi que hay total flexibilidad en todo eso.\n\nNos gustara que el siguiente:\n\n- Ducha grande - mnimo 100x120cm\n- Una doble lavabo / lavamanos o 2 individuales\n- Uno o Grohe Geberit (eventualmente estndar)  mural wc.\n- Una especie de armario (puede ser muy pequeo)\n- Unidades de almacenamiento\n- Finalmente, una baera (nos gusta baeras de hidromasaje, pero no es obligatorio).\n\nTambin puede encontrar fotos de baos que nos gustan en el siguiente enlace:\n\nhttp://www.houzz.com/ideabooks/6232812/_trid=bGF1cnkxMjtsYXVyZW50QGJ1cnkuYmU/thumbs/SDB-parents\n\nGracias\n\n****************************\n\nThis house is a second-residence. We go with our 2 kids several times a year. We meet friends and relatives there.\n\nKindly find some details below:\nHeight before renovation is indicated on the plan i.e. 250cm - It might change a little bit. If needed I can ask for a better estimation.\n\nFor information the small guest bathroom (on the left on the plan) will disappear and become a small open office room.\nElectricity, Hot, Cold water and sewage will be completely redone - so full flexibility on that. \n\nWe would like the following:\n- Large shower - minimum 100x120cm\n- One double sink/lavatories or 2 single ones \n- One Grohe or Geberit (eventually ideal standard) wall-hung wc\n- Some sort of wardrobe (can be quite small)\n- Storage units\n- Eventually a bathtub (we do like Whirlpool Tubs but it is not mandatory.\n\nAlso kindly find below pictures of bathrooms we like:\nhttp://www.houzz.com/ideabooks/6232812/_trid=bGF1cnkxMjtsYXVyZW50QGJ1cnkuYmU/thumbs/SDB-parents','2013-01-15 12:23:23',NULL,'2013-01-15 12:23:23',NULL),
  (2389,2156,2155,NULL,48,6,12,NULL,'2013-01-16 12:40:58','Mensaje del cliente:\n\nLos siguientes cambios / adiciones:\n\nPor favor, aada una versin pequea o algo del diente con filigrana que tena en su propuesta.\n\nNo s si me gusta el doctor con la mscara. Necesita atraer a primera vista. La gente puede asustarse! \n\nLa forma en que se integr al mdico con el fondo,  lo hace ver como una monja. Creo que sera mejor con toda la cabeza contra el fondo. Tal vez un mdico sin mscara o una asistente dental atractiva / en vez de hombres. Muestra un lado ms suave de trabajo dental.\n\nNecesito una oferta especial en la tarjeta \"Free teeth whitening or $150 off any dental work needed\". As ellos pueden elegir cual quieren,  ambos estarn en la tarjeta como \"OR\".\n\nSi queda un espacio sin hacerlo ver demasiado lleno, podemos aadir \" benefits to coming to us- all specialties under one roof; late evening and weekend hours\".\n\nAdems, el nmero de telfono y sitio web debe ser audaz y tan grande como sea posible.\n\nMe gusta el fondo amarillo mas que azul, pero si podemos tener un fondo dorado, eso me gustara ms. Si no, un fondo de color naranja oscuro con filigrana sera genial.\n\nY, por supuesto, todo esto en espaol en el lado opuesto.\n\nGracias\n\n************************************\n\nI asked for the following changes/additions:\n\nPlease add a small or some version of the tooth with filigree you had on the samples you sent with the proposal. \n\nI don''t know if I like the doctor with mask?? Post cards need to attract at the first glance. People may get scared or turned off!!! The way the doctor is integrated with the background makes him look like a nun. I think it would be better with his whole head against the background. Maybe a doctor with no mask or attractive female dental assistant/doctor instead of male. Shows a softer side of painful dental work.\n\nI need a special offer on the card- Free teeth whitening or $150 off any dental work needed. They can choose which offer they want-both would be on the card as \"OR\".\n\nIf there is room without making it too crowded we can add benefits to coming to us- all specialties under one roof; late evening and weekend hours.\n\nAlso, the website and phone number should be bold and as big as possible.\n\nI like the yellow background better than blue- but if we can get a gold background- I would like that more. If not a dark orange background with filigree would be great. \n\nAnd of course all this in Spanish on the opposite side.','2013-01-16 12:40:58',NULL,'2013-01-16 12:40:58',NULL),
