  (2400,2363,2362,NULL,48,6,12,NULL,'2013-01-17 14:49:30','Mensaje del cliente>\n\n Cuando estes haciendo el diseo, cambia el nombre a:\n\nWATERPOLO Foosball Table (Tabla de Foosball-Piscina Flotante).\n\nTambien, observa la imagen de la mini mesa de futboln , slo hay 4 lneas de barras con 3 jugadores en cada barra.\n\nSi puedes incluye el anuncio de puntuacin a cada lado, como se muestra en la foto.\n\nGracias\n\n_____________________________\n\nWhen you are doing the layout with the text, please change the name to:\n\nWaterPolo Foosball Table (from- Pool Floating Foosball Table).\n\nI forgot to say, Please notice the image of the mini foosball table exsample, there is only 4 lines of bars with 3 players on each bar.\n\nAlso if you can ad the scoring strip on each side as shown in the photo','2013-01-17 14:49:30',NULL,'2013-01-17 14:49:30',NULL),
