  (2402,2360,2359,NULL,53,6,12,NULL,'2013-01-17 15:51:09','Por favor realizar las siguientes tareas:\n\n1. Quitar el 2do slide del slider (quitar el que tiene una flor)\n2. En el slide 1 POner lo siguiente en el titulo del slider. \" oneGIGAhosting, we host your dreams\", y el contenido:\nThe best website hosting for startup or individual business. High quality at lowest price: Just 3.90 USD/month','2013-01-17 15:51:09',NULL,'2013-01-17 15:51:09',NULL),
