  (2404,2360,2359,NULL,53,6,12,NULL,'2013-01-17 16:00:18','Cambios en features (fila debajo del slider)\n1. LOW PRICE FOR LIFE\nWe never increase our prices. We don''t use the policies from another hosting services where you pay a low price just for first month and the next ones are higher.\nYou will have just one price for life. 3.90 USD/month ( less price for our friends. Yes you!).\n\n2. FREE WEBSITE TRANSFER\nDo you want to come over to oneGIGAhost, but are currently hosting your website with another host and don''t want the hassle of transferring all the files? We will be more than happy to help you transfer your entire website!.\n\n3. Supper-duper Support\nHaving problems with your hosting? We''re here to help. Our friendly support team are always eager to help you out with set up and configuration problems.','2013-01-17 16:06:02',NULL,'2013-01-17 16:00:18',NULL),
