  (2407,2363,2362,NULL,48,6,12,NULL,'2013-01-17 16:14:34','Mensaje del cliente\n\nMe gusta el diseo, slo un par de cosas:\n\n1. Me gustara hacer en la primera lnea de texto - (Una tabla flotante mini futboln  para la piscina)  mas grande (entre el tamao del nombre y el tamao del texto)\n\n2. Podrias hacer que la tabla luzca ms como el render que me enviaste? para que se vea ms como el tema de waterpolo y menos como el ftbol (ftbol).\n\n3. La (c) en la parte inferior, debe ser una marca de derechos de autor con un crculo cerrado.\n\nGracias\n\n____________________________\n\nI like the layout, Just a couple of things:\n\n1. I would like to make the first line of text - (A floating mini foosball table for the pool) biger in size. (between the size of the name and the size of the other text)\n\n2. Can you make the table look more like the render that you sent? so it looks more like the water polo theme and less like the soccer(football).\n\n3. The (c) in the bottom should be a copyright mark with a close circle.','2013-01-17 16:14:34',NULL,'2013-01-17 16:14:34',NULL),
