  (2445,2434,2433,NULL,55,6,15,NULL,'2013-01-21 19:21:46','Sobre la revisin de blogs en smashingmagazine.com, aun falta revision detallada, a continuacin de describe parte general del blog.\n/**********General**********/\nInicialmente se muestra la categoria\n1. Categoria: Nombre categoria\n2. Pequea descripcion de la categoria\n3. Enlaces a etiquetas populares para la categoria (Popular tags in this category: Web design, Typography, Design Legacy, Navigation...)\n\n4. Titulo del blog (h2)\n5. Autor(By Nombre Apellido del autor)\n6. Linea de separacin\n7. Fecha, Tags, Cantidad de Comentarios(24 Comments) \n8. Introduccin del tema del blog(1parrafo)//*\n9. Imagen\n10. Resumen del contenido acerca del blog(1 parrafo)//*\n11. Enlace para \"Read More\"  \n12. Linea de separacin(mas visible que el anterior) para inidicar inicio de otro blog\n\n//* estos contenidos pueden contener negrilla, cursiva o enlaces\n// Los titulos, la imagen y \"read more\" son enlaces al detalle del blog','2013-01-21 19:21:46',NULL,'2013-01-21 19:21:46',NULL),
