  (2584,2583,2583,NULL,48,6,14,'Comentarios del cliente','2013-02-26 11:52:02','Estoy buscando un diseo de la cubierta para el CD de meditacin para nios. \n\nEn el panel delantero fuera, la imagen de varios nios, edades 6-14 corriendo a travs de un campo verde con un cielo azul. Los nios que exuda alegra, la libertad, el poder. \n\nTexto en la parte superior, con el poder Meditaciones para Nios. \n\nTexto en la parte inferior delantera,  herramientas para que los nios tengan el control de su vida. \n\nEl panel trasero, cielo azul, campo verde, tal vez algunas flores o naturaleza. \n\nDentro del panel izquierdo, una imagen del nio meditando en la naturaleza, tal vez algo ms ligero, para que pueda imprimir texto en la parte superior de la misma. \n\nPanel lateral derecho, al igual que el panel trasero, hierba verde, cielo azul.\n\n\nGracias\n\n********************************************\n\nI''m looking for a jacket design for a children''s meditation CD. On the outside front panel, picture of several children, ages 6-14 running thru a green field with a blue sky. The children are exuding joy, freedom, power. Text on top, Empowered Meditations for Children. Text on bottom front, tools for children to take charge of their life. Back panel, blue sky, green field, maybe some flowers or nature. Inside left panel, a picture of child meditating in nature, perhaps lighter so I can print text on top of it. Right side panel, same as back panel, green grass, blue sky.','2013-02-26 11:52:02',NULL,'2013-02-26 11:52:02',NULL),
  (2585,2584,2583,NULL,48,6,12,NULL,'2013-02-26 11:54:33','Mensaje del cliente\n\nEn la cubierta principal, me gustara tener una foto de 4 o 5 nios de diferentes nacionalidades, corriendo a travs de un campo. Tal vez dos nios blancos, 1 negro, 1 de Asia. Para el interior de la cubierta, me gustara una nio blanco, sentado en postura de meditacin. \n\nGracias\n\n*********************\n\n\"Hi, on the front jacket, I would like to have a photo of 4 or 5 children of different nationalities, running through a field. perhaps 2 white children, 1 black, 1 Asian. For the inside jacket, I''d like one white child, sitting in meditation pose. I look forward to seeing your work, Thanks \"','2013-02-26 11:54:33',NULL,'2013-02-26 11:54:33',NULL),
  (2586,2584,2583,NULL,48,6,12,NULL,'2013-02-26 12:06:20','Mensaje del cliente\n\nAqu esta el texto para el exterior ( frente y detrs ):\n\nEn el frente - \"Empowering Meditations for Children\" (arriba de la foto de los nios)  y en la parte de abajo - \"your toolbox for a successful life\".\n\nEn la parte de atrs-\n\n1. Mindful Breathing (6.42)\n2. Performance (5.48)\n3.Loving Kindness (10.50)\n4.Journey to Your Sanctuary (10.44)\n5.Your Body Connection (10.05)\n6.Cultivation Compassion (7.39)\n\nDenise Rizvi is a Naturopath, meditation teacher and soulful life couch.\nShe is board certified with the American Association of Drugless\nPractitioners. Denise completed a two year intensive certification program\nwith Alberto Villoldo, PhD. & The Four Winds Societys Healing The Light\nBody in Inka Shamanic Energy Healing. She went on expedition through Peru\nand trained directly with the medicine people of the Andes. She is\ncertified through Vianna Stibals Natures Path in Theta Core Belief\nhealing, DNA 1 & 2. She is also a certified instructor of the Nia\nTechnique. Denise has a private meditation and life coaching practice in\nSummit NJ. Please visit her website at *www.Deniserizvi.com*\n\nGracias','2013-02-26 12:06:20',NULL,'2013-02-26 12:06:20',NULL),
  (2587,2584,2583,NULL,48,6,12,NULL,'2013-02-27 14:10:16','Mensaje del cliente\n\nAcabo de notar un error de escritura, en la pista cubierta posterior 6. debe decir\nCultivating Compassion, no,  Cultivation Compassion.\n\ngracias','2013-02-27 14:10:16',NULL,'2013-02-27 14:10:16',NULL),
