  (2626,2625,2625,NULL,48,6,14,'Comentarios del cliente','2013-03-04 14:41:52','Necesito un banner  para mi sitio web. El sitio es un sitio genrico de bienes races residenciales que (actualmente comercializada bajo mi nombre) en\n\nwww.mississaugarealestatemarket.com\n\nDebe ser limpio, profesional y comunicar a la compra y venta de casas con colores similares a los del sitio web actual.\n\n- El texto para el banner es el siguiente:\n\nMississauga Mercado Inmobiliario\n\n- Me gustarian imgenes de casas si es posible, los sitios que me gusta el estilo de son\n\nhttp://www.realwebsolutions.com/\n\nTambin me gusta el estilo que ha creado en su banner pero que la ma sea ms \"como negocio\"\n\nTamao del banner es 998 X212 pxeles\n\nGracias\n\n\n******************************\n\nI need a banner designed for my website. The site is a generic residential real estate site which (currently branded under my name) at mississaugarealestatemarket.com \n\nShould be clean, professional and convey the purchase and sale of homes using similar site colours to current site\n\nText for banner is:\n\nMississauga Real Estate Market\n\nI would like images of houses if possible\n\nSites I like the style of are\n\nhttp://www.realwebsolutions.com/\n\ni also like the style you created your banner in but would want mine to be more \"business like\" \nhope that helps\nBanner size is 998 X212 px','2013-03-04 14:41:52',NULL,'2013-03-04 14:41:52',NULL),
