  (2629,2584,2583,NULL,48,6,12,NULL,'2013-03-05 12:52:58','Mensaje del cliente\n\nMe gusta el brillo y el sentimiento de los nios. Me gusta la opcin 2, pero tambin me gustara ver algunas imgenes ms de los nios antes de tomar una decisin final.\n\nAdems, en la parte inferior vamos a escribir \"tools for a successful life\" en vez de \"your toolbox...\"\n\nLa fuente de  mi informacin personal en la parte inferior de la contraportada, no es legible, podras utilizar un tipo de letra ms delgado o reformatearlo para que sea mas claro?\n\nGracias\n\n******************************\n\nthanks for the first draft. I like the brightness and feeling of the\nchildren. I prefer option 2 but would also like to see a few more pictures\nof children before making a final decision.\n\nAlso, let''s write ''tools for a successful life'' on the bottom instead of\n''your toolbox...''\n\nthe font on the bottom back cover for my personal info. is not legible, can\nwe use a thinner font or reformat that to bring more clarity?\n\nthanks and I look forward to seeing the next draft.','2013-03-05 12:52:58',NULL,'2013-03-05 12:52:58',NULL),
