  (2640,2584,2583,NULL,48,6,12,NULL,'2013-03-11 09:24:28','Mensaje del cliente\n\nMe gustara utilizar una combinacin de los dos diseos.\n\nEn la portada exterior, me gustara que la foto de la primera opcin de nios apuntando hacia arriba.\nEn la contraportada exterior, me gustara la foto de la segunda opcin del nio meditando en la hierba.\n\nMe gustara tratar de acento de color verde en lugar de azul.\n\nEn cuanto al texto del interior, si se refiere a la descripcin original, explique que habra un frente exterior y uno detrs,  y que al abrir la caja del CD estaran las imgenes y el texto tambin. \n\nSi se abre cualquier caja de CD joya, el interior no est en blanco, vers que hay dentro\nimgenes y texto.\n\nPor favor refirase a la descripcin de mi trabajo para obtener instrucciones sobre\nel interior.\n\nGracias\n\n************************\n\nThank you for the update. I''d like to use a combination of the 2 designs.\n''\nOn the outside front cover, I''d like the pix from the first option of\nchildren pointing up.\nOn the outside back cover, I''d like the pix from the second option of child\nmeditating in grass.\n\nI''d like to try green accent color instead of blue.\n\nAs for the inside text, if you refer to my original job description, I\nexplained that there would be an outside front and back and when you open\nthe CD case there would be inside pictures and text as well. If you open\nany CD jewel case, the inside is not blank, you will see there are inside\npictures and text. Please refer to my job description for instruction on\ncreating the inside.','2013-03-11 09:24:28',NULL,'2013-03-11 09:24:28',NULL),
