  (2645,2633,2607,NULL,48,6,12,NULL,'2013-03-15 10:02:42','Mensaje del cliente\n\nLuce bien. Slo hay unos cambios que quiero hacer:\n\nQuitar el borde blanco del logo de ABC, y aadir el website y el nmero de telfono en el folder (debajo de la araa) www.ABCDOREME.com (800) 560-9466.\n\nEn cuanto al banner musician : Me gust, pero me gustara hacer varios cambios:\n\nPodemos hacer que el color de fondo un morado claro?\nMe gustara quitar las columnas de colores y las notas de la msica que aadiste.\nPodemos tratar de cambiar las fuentes a la mquina de escribir americana?\nMe gustara quitar el borde blanco del logo ABC.\nSe puede aadir una suave ola  para el diseo del fondo, en lugar de las lneas que hiciste? Me gustara que se vea ms suave.\n\n**************************\n\nLooks good. They only changes I want to do are:\nRemove the white border from the ABC logo and add the webstie and phone number on the folder (under the spider) www.ABCDOREME.com (800) 560-9466.\n\nRegarding the musician banner: I liked it but I would like to do several changes:\nCan we make the background color light purple?\nI would like to remove the colored columns and the music notes you added to it.\nCan we try to change the fonts to American Typewriter?\nI would like to remove the white border from the ABC logo.\nCan you add a soft wave to the design of the background instead of the lines you did? I would like it to be more soft looking.','2013-03-15 10:02:42',NULL,'2013-03-15 10:02:42',NULL),
