  (2667,2654,2653,NULL,54,1,12,NULL,'2013-03-22 16:55:52','Comentarios del cliente\n\nAadir el pavimento del estacionamiento alrededor del edificioy tambin agregar en la caja de potencia para referencia que est en el csped frente al edificio.\n\nLos lmites del pavimento deben estar en el RPR  que te envie (el pdf con las mediciones)\n\nGracias\n\n\n************************************\n\nI have one favor and it is to add the pavement to the parking lot around the building  and also to add in the power box for reference that is on the front lawn of the building.\n\nthe boundaries of the pavement should be in the RPR i sent (the pdf with the measurements)','2013-03-22 16:55:52',NULL,'2013-03-22 16:55:52',NULL),
  (2668,2584,2583,NULL,48,6,12,NULL,'2013-03-25 13:23:23','Mensaje del cliente\n\n\nCuando vi el borrador final, no vi  la pequea pieza que estar en la ''columna vertebral'' de la caja.\nDebe tener el nombre del CD \"Empowering Meditaciones for Children\". \n\nEl espacio del que estoy hablando es el que esta entre el frente y la espalda cuando la caja esta cerrada. Es de 1/8 pulgada de ancho, sabes a  lo que me refiero?\n\nGracias\n\n\n*********************************\n\nI sent the final payment last night but when I looked at the final draft I\ndidn''t see the small piece that will be on the ''spine'' of the jewel case.\nIt should have the name of the CD, Empowering Meditations for Children. The\nspace I''m talking about is the in between front and back when the case is\nclosed. It''s about 1/8 inch wide, do you know what I''m referring to?','2013-03-25 13:23:23',NULL,'2013-03-25 13:23:23',NULL),
