  (2675,2654,2653,NULL,54,1,12,NULL,'2013-03-27 09:27:01','Mensaje del cliente\n\n\nMe preguntaba si podras poner una tercera imagen,  de modo que serian 3 letreros digitales en lugar de 2.\n\nTres imagenes digitales en vez de 2, todos seran del mismo tamao 32X14\n\nGracias\n\n\n*****************************************\n\nhi, I was wondering if you could put up a 3rd face so that there are 3 digital signs instead of the 2\n3 digital faces instead of the 2,  they would all be the same size 32X14','2013-03-27 09:27:01',NULL,'2013-03-27 09:27:01',NULL),
