  (2677,NULL,2677,NULL,54,1,11,'ROB - 3D HYDRACUP RENDER','2013-04-01 14:26:11','','2013-04-05 15:15:38',NULL,'2013-04-01 14:26:11',NULL),
  (2678,2677,2677,NULL,54,1,14,'Comentarios del cliente','2013-04-01 14:26:44','Tres  renders de nuestros productos,  Si ve nuestro sitio web hydracup.com queremos mantener todo igual para estos nuevos renders tal como aparece en el sitio web. \nEsto incluye el matiz de las botellas y colores de tapa / el ngulo de las tazas. Estamos tratando de hacer  nuevos renders para los hydracups. Queremos que estos renders muestren diferentes contenidos diferentes en cada hydracup. Habr un render nuevo para el verde y un render nuevo para los rojos originales (borrar) hydracups. El primer render con el que nos gustara empezar es con el de copa verde.\nNew Green Cup Render\nNos gustara que tenga un lquido verde nuevo en el lado derecho y  un montn de almendras en el otro lado. Por favor refirase a la imagen adjunta. El nivel del lquido en el lado de mano derecha debe ser el mismo que es actualmente. Las almendras en el lado izquierdo debe llenar la copa hasta el nivel marcado en la imagen. No hay otros componentes deban ser cambiados y por favor mantenga el color de la tinta que antes. (Ver archivo adjunto del lquido verde y la botella)\nNew Red Cup Render\nEsta copa nos gustara reemplazar el lquido en el lado derecho con un lquido rojo (ver archivo adjunto) y nos gustara poner un pltano en el lado derecho (imagen adjunta). El lquido rojo nuevo debe llenar a la misma altura que la anterior naranja-lquido en el lado derecho (ver archivo adjunto).  Se debe colocar de tal manera que se puede ver la curvatura de la banana y el tallo similar a la imagen adjunta. Ningn otro elemento debe ser cambiado y por favor mantenga  el tinte de la base de la botella.\nEstos renders estarn situados en nuestra pgina principal y no ser muy grande. Sin embargo queremos incluir tambin las imgenes a tamao completo en otras pagina asi que nos gustara tender los archivos  en alta calidad.\nPor favor, dgame si tiene alguna pregunta.\nGracias\n****************************************\nWe are looking for 2 new renders of our products. If you view our website hydracup.com we want to keep everything the same for these new renders as it appears on the website. This includes the tint on the bottles and lid colors and view/angle of the cups. We are looking to do two new renders for the original or clear hydracups. We want to have these renders show off different contents in each hydracup. There will be a new render for the green and a new render for the red original (clear) hydracups. The first render we would like you to start on is the green cup. \nNew Green Cup Render\nWe would like the green cup to have a new green liquid on the right side and to have a bunch of almonds on the other side. Please refer to the attached image. The level of the green liquid on the right hand side should be the same as it is currently. The almonds on the left side should fill the cup to the level marked in the picture. No other components should be changed and please keep the tint color the same as before. (Refer to attachment green liquid & Green Bottle)\nNew Red Cup Render\nThis cup we would like to replace the liquid on the right side with a red liquid (attachment red liquid) and we would like to place a banana on the right side (banana attachment). The new red liquid should fill to the same height as the previous orange-liquid on the right side (seem overall placement attachment). The banana should be situated so that you can see the curvature of the banana and the stem similar to the attached picture. No other elements need to be changed to this and please keep the tint of the bottle base the same as before. \n\nThese two renders will be situated on our main banner page and will not be that big. However we want to include the images in full-size on the product page.If we can get high quality files for these renders it would be much appreciated. Below are the changes in a brief summary and I have attached specific details in the attachments below.\n\nPlease let me know if you have any questions.','2013-04-01 14:26:44',NULL,'2013-04-01 14:26:44',NULL),
  (2679,2654,2653,NULL,54,1,12,NULL,'2013-04-01 16:23:36','Cambios adicionales\n\n\nTengo algunos cambios que necesito:\n\n1) sacar la cara  que es plana del letrero y reemplazarlo con otra pantalla digital que sea curva como los otros lados.\n\n2) Aadir al diseo roca alrededor de la base del poste,  te proporcionare un ejemplo\n\n3) mover poste al estacionamiento.\n\n**************************************\n\nI have a few changes i need:\n 1) remove the flat face of the sign and replace with another digital screen curved.\nand these changes I will pay for the extra hours\n2) add rock design around bottom of pylon\n we will provide example\n 3) move pylon onto parking lot','2013-04-01 16:23:36',NULL,'2013-04-01 16:23:36',NULL),
