  (2682,2654,2653,NULL,54,1,12,NULL,'2013-04-02 15:59:45','Comentarios del cliente\n\n1. El diseo del poste se supone que tiene 3 lados, cada esquina tendra tira de luz como se muestra en el ejemplo adjunto.\n\n2. Ademas \"Corner 170\" , ir en el panel justo como en el ejemplo de \"Holiday Inn\" \n\n3. Los lados del poste tienen que coincidir con las partes del letrero  o se vera chistoso. En el poste es donde ir \"Corner 170\" el cual necesita para ser retroiluminado como le ejemplo  de \"Holiday Inn\" con luz azul.\n\nPodras tambin poner  la pantalla en un ngulo similar al de la curva roja por favor, como se muestra en el archivo adjunto? esto para asegurarse que el ngulo de visin sea adecuado.\n\nGracias','2013-04-02 15:59:45',NULL,'2013-04-02 15:59:45',NULL),
