  (2687,2678,2677,NULL,54,1,15,NULL,'2013-04-05 09:05:56','1. El ngulo se prefiere de la copa es para ser ms desde el lado. Al igual que la imagen adjunta.\n\n2. Slo para tu informacin los colores son un poco ms oscuros, un poco ms oscuro que lo que nos gusta. Creo que hay algunas imgenes de referencia, pero por favor para el ngulo, la posicin, la colocacin de las botellas., ve\n\nwww.hydracup.com \n\n3. El color de la tapa y el lquido verde deben ser de un verde como el de la imagen que te envi.\n\n4. Slo para aclarar y tratar de hacer que el ngulo de la botella exactamente como www.hydracup.com para la tapa de la botella verde.\n\n\n\n******************************************\n\n The angle we prefer of the cup is to be more from the side. Like the picture above.\n\nGreat. Just FYI the colors are a little darker then what we prefer. I think there was some images I sent you that you are referencing but please use www.hydracup.com for the angle, position, placement of the bottles.\n\nThe color for the lid and the green liquid should be a green like the image i sent you.\n\njust to clarify try and make the angle of the bottle exactly like www.hydracup.com for the green cap bottle.','2013-04-05 09:05:56',NULL,'2013-04-05 09:05:56',NULL),
