  (2689,2678,2677,NULL,54,1,12,NULL,'2013-04-05 09:07:01','Comentarios del cliente\n\nHan habido algunos avances desde las ltimas actualizaciones. No estoy contento con la iluminacin en la tapa. Las almendras se ven mejor. Espero que se vean bien cuando pongas mas en el interior. El lquido verde est bien ... Voy a tener que mirar un poco ms. He adjuntado una imagen de algunos cambios.\n\nMe di cuenta de que esta no es la versin final. Me gustara saber si hay algo que pueda hacer del render o photoshop para llevar a tener las lneas de medicin en la botella un poco.\n\nLa lnea sealada a la derecha es realmente un dolor de ojo. Hay alguna manera de minimizar su apariencia?\n\nMirando esta imagen otra vez, no es aceptable para el tipo de imagen que estoy buscando. Queremos una imagen similar ( ver imagen adjunta).\n\nesperemos que la versin final sea realista como la imagen de la botella.\n\n\n**************************************************************\n\n\nThere has been some progress since the last updates. I''m not super content with the lighting on the lid. The almonds look better. Hopefully they will look good when you put more of them inside. The green liquid is ok... i''ll have to look at it some more. I''ve attached an image of some changes.\n\nI realize that this isn''t the final version. I would like to know if there is anything you can do post render or photoshop to bring out the measuring lines on the bottle a bit.\n\nthe line pointed out on the right is a real eye sore. Is there a way to minimilze it''s appearance?\n\nSo looking at this image again it is nowhere near acceptable for the type of image I''m looking for. We want an image like.','2013-04-05 09:07:01',NULL,'2013-04-05 09:07:01',NULL),
