  (2694,2693,2693,NULL,54,1,14,'Comentarios del cliente','2013-04-05 11:51:46','Need someone to do some 3d drawings of the new office I am setting up. It has a retail and medical component. I have an idea about what I want for the lighting as well and I would like to see what the 3d look of the lighting would be like.','2013-04-05 11:51:46',NULL,'2013-04-05 11:51:46',NULL),
  (2695,2694,2693,NULL,54,1,15,NULL,'2013-04-05 12:00:17','Hi there, I like your style. Key is I would want someone to get started on this right away. I would like to work on the front part the retail first because, I need to figure locate exactly where the in floor plugs will be. So I would like to see how the proposed desks (3 main ones) look in the space and the waiting area and the \n\nThis is an optical/optometry office. \n\nI have eg light fixtures I am looking at using as well as some example photos of the look and feel of the place as well as the ceiling example with lights.\n\nI like the look and feel of this office. \n\nhttp://barbarawrightdesign.com/portfolio/jamie-rose-eyewear\n\nI do not want fluorescent lights in the ceiling though and it is a drywall ceiling in the retail part and the hallway down to the medical offices. Otherwise there is tbar ceiling for the medical sides (once you see the cad you can picture). Bascially the space is 1000 sq ft, front half retail back half medical.\n\nI was thinking pot lights in the front, I will show some example ceilings I saw that I liked but if you have any cool ideas let me know. Want the look of the ceiling to be simple clean exciting with nice pot lights and white drywall with nice reflections. Will upload the two pictures I took of example look here.\n\nI will load the mechanical and electrical latest ones now to show you the layout.\n\nI have an idea of the desk that I want as well but would be so good to see it in 3d to finalize!\n\nexample ceilings with pot lights that are simple. any input from you regarding a nice look would be great. I was thinking having the pots along the outer edges of the ceiling all around the space. \n\nimage 517 is an example pendant light I liked for over the reception desk. it is the one that is silver cone shape bottom right \n\nmechanical drawing of office space. note the main reception desk will be more to the corner and differently shaped. I will send my very (very) rough drawing attempt to superimpose the desk and the location on the plan. :) The two smaller desks will also be set in slightly different spots, will be able to determine after get the retail 3d part done. \n\nImage 553 is the one where I drew in an example desk shape. It needs to be spaced properly so there is enough space for the workers to use the desk but also so that the desk does not waste my retail space so the glasses cabinets can be maximized along the wall that reaches the reception desk. \n\nanyway I have given a lot of detail here. Dont want to overwhelm you with detail at the start. \n\n\n\nHI Sole wanted to mention re the two smaller desks, as one comes in the front door there is one on the left and one on the right. Both should be turned 90 degrees from their position now. These are tables with little mirrors and computer monitors/computers on them where patients sit down to look at glasses on their faces and also pay for glasses there. In my present office I believe the little desk sits approx 3 to 3.5 ft away from the glasses displays. The desks themselves are approx 2 ft wide by 3.5 ft long. If u have a suggestion re size on the small tables let me know. These small tables will look like satelittes to the larger reception desk. \n\nThe key with the one on the right is that directly to the right as one comes in the front door there will be a waiting area positioned there. You can look at the link here and see the waiting area they have showing in the window (http://barbarawrightdesign.com/portfolio/jamie-.... The waiting area will be there except on the right not left as shown in that link. So the spacing from the waiting area to that little table to the right as one comes in the door must be far enough away and to the right of the waiting area, close to the display cases so that people in the waiting area will not be staring at the people at that table. \n\nThe one on the left as you come in the front door should be the same size as the other one to the right, and also the same distance away from the glasses displays along the wall. Please note the reception desk does not come out that far into the retail space. \n\nSo that is the last aspect, the reception desk. There are three functions here, people check out, people check in, and possibly people picking up glasses. As people leave the exam room areas, as they come down the hallway and look to their right they would see the reception desk there. I would want them to be able to check out here and pay. The desk shape I thought would work best is one that has two sides and then a bit longer front as hopefully you can see in the sketch of the desk I did behind the one that is suggested in the drawing. The check out could occur at that first side as someone has come down the hallway and looks to the right. The check in could occur at the front part of the desk. The glasses pick up and trying on and payments could occur at the last third part of the desk closest to the wall. \n\nI want to move that reception desk as close as I can to the corner it is in but still maintain proper function here. I would then want to maximize the glasses display case area. \n\nThe reception desk itself I picture as being made mostly of wood, with some metal accents or steel and at the front of the desk will be the logo (picturing blue letters: Seton Optometry). The front part will be translucent or partially see through and can light would shine through that see through part. Not sure if you watch the show Anderson Live (Anderson cooper''s talk show but he has a desk he sits at wehre the front part has his name in blue letters and there is a semi see through material on the front of the desk that can allow back light to shine through. Anyway these details can be added later just wanted to give you a feel for the look and feel of the desk. As long as we can intially get the size and shape and placement correct in the initial 3d mock up would be good. If you have any suggestions as to shape and size of desk I am all ears. \n\n\nThese are the latest cads but note the waiting area is now moved from near the right back corner (as one walks in the front door) to the front of the store and in its place will be more glasses display cases as you see in that link http://barbarawrightdesign.com/portfolio/jamie-...\nas you look in the window. There will be some of the fancier display cases as you see at the back of the store which look like they have each section lit up. Then along the sides of the store to the left as one walks in there will be more simple displays, more open with more just glass shelves there. To the right wall I was thinking of having at least one other 4ft wide by 6 ft high fancier display case like the one seen at the back of the store in this link http://barbarawrightdesign.com/portfolio/jamie-... \n\nI can choose either 4 or 5 ft wide displays. Let me know whichever works better for the 3d and spacing.\n\nSo if in the inital mock up Sole we can just focus on the retail front part of the office and the placement and size of the two interface stations, the waiting area ( should be at least 4 waiting chairs there), and reception desk. We were planning on having a soffit hanging from the ceiling. Once you have some sort of draft for that would love to see it. \n\nOnce done the latter then can focus on lighitng. Was thinking of having pot lights in the retail with drywall ceiling. Had 3 pendants hanging down from soffit shape around the reception. \n\nHad one pendant each hanging down to the each interface station.\n\nDo not have any track lights.','2013-04-05 12:00:17',NULL,'2013-04-05 12:00:17',NULL),
