  (2712,2694,2693,NULL,54,1,12,NULL,'2013-04-09 09:35:05','hola, \n\nEl primer borrador  se ve bien, es agradable ver la versin que la version en 3D va tomando forma. Cun lejos de la pared estan los dos escritorios?\n\nEl escritorio de la recepcin, voy a subir su forma en mi \"boceto\" no es una forma cuadrada o una L,  es una con tres lneas al escritorio, es difcil de explicar, pero ignora el primero que est en el dibujo principal y mira ms el que esta en la esquina, el que est brillantemente dibujado por m. \n\nLo dibuj demasiado lejos en la esquina bc, hay algunos gabinetes detrs del  escritorio de la  recepcin tambin,  pero por lo menos puedes tener una idea.  Subire el  \"sketch\" de nuevo para que sepas a que me refiero (IMAG0553.jpg).\n\nPara la iluminacin me estaba pensando todo con luces (potlights), como en este imagen con  un techo de paneles de yeso blanco.  Luces (potlights) donde se puede ver un crculo de luz en lugar de un  tipo indirecto de iluminacin . \n\nMe estaba imaginando tal vez luces (potlights) a lo largo de la parte exterior del techo, pero tambien  estoy abierta a cualquier idea que puedas tener. \n\nGracias\n\n****************************************\n\nhi, the first draft looks good, it is neat to see the 3d version taking shape.  how far from the wall are the two desks?\nalso the reception desk I will load the shape of it in my \"sketch\" it is not a square or L shape it is one with three lines to the desk. hard to explain but ignore theone that is on the main drawing andlook more in the corner for the one that is brilliantly drawn by me. I drew it too far in the corner bc there are some cabinets behind the reception desk as well but at least you canget some idea. will load up the \"sketch\" again here so you know which one I mean\n\n\nFor the lighting I was picturing all potlights as in this picture here with white drywall ceiling. pots where you can see the circle of light instead of the indirect type lighting. I was picturing maybe pots along the outside of the ceiling but I am open to any ideas you might have ( IMAG0536.jpg).','2013-04-09 09:35:05',NULL,'2013-04-09 09:35:05',NULL),
