  (2715,2611,2610,NULL,48,6,12,NULL,'2013-04-09 09:54:59','Hola,\n\nEl sitio se ve muy bien en general.\n\nAdjunto algunas fotos que eleg para las 5 diapositivas en la pgina principal.\n\nPor favor, selecciona las fotografas que creas sean las mejores para promover la idea detrs de los enlaces a la pgina correspondiente. Tambin en lugar de dos diapositivas de  growth program, voy a aadir una nueva seccin en el sitio para la gente que desea ver cmo vender su negocio. Esto lo puedo aadir ms adelante.\n\nQu ms tiene se tiene que hacer para completar el sitio?\n\nGracias\n\n****************************************************\n\nThe sites looks great overall. \n\nPlease find attached some photos that I have chosen for the 5 main slides on the home page. \n\nPlease select the photos from this selection which you think would best promote the idea behind the link to the appropriate page. Also instead of two growth program slides, I will be adding a new section to the site for people wanting to see how to sell their business. I can add these later on.\n\nWhat else do you need to do, to complete the site at this stage?','2013-04-09 09:54:59',NULL,'2013-04-09 09:54:59',NULL),
