  (2717,2694,2693,NULL,54,1,12,NULL,'2013-04-10 11:12:45','Comentarios del cliente\n\n- Quiero minimizar el espacio de recepcin para maximizar el rea de la venta al por menor. Quiero un rea del escritorio sea para el check out  ya la gente viene desde el pasillo, y un rea  para el check in (parte frontal). \n\n- Un rea de estar a lo largo de la pared, donde la gente puede sentarse y recoger sus lentes. El techo de la zona de recepcin es de 10 ft de altura.\n\n-  Hay una pared que separa el bao de la zona de los nios.\n\n- Estoy moviendo el rea de espera hacia  la parte delantera de la tienda, me gustara que entren al menos 4 sillas, cada silla ocupa aproximadamente 2 pies, podramos colocar 2 a lo largo de la ventana, una frente a una pared una frente a la otra pared.  El rea de espera estar en la parte delantera de la tienda junto a la ventana. \n\nQu piensas acerca de mover la recepcin al frente? ... seria la primera cosa que la gente vea cuando entren por la puerta,  entonces esto abre todo el espacio detrs de la recepcin para visualizar los lentes por que detrs de la recepcin hay una rea muerta ne este momento....excepto que sea para el almacenamiento que es importante tambin. Cuan lejos crees que debera estar le escritorio  de la recepcin de la puerta?\n\n- Si tengo el escritorio cerca de la puerta, tendra un gabinete justo detrs de de donde estn los lentes terminados y en espera. Esto tambin creara un espacio privado detrs del escritorio para dar al trabajador un rea privada.\n\n- Podra tener calefaccin que venga de arriba de la puerta, esto podra resolver el problema de calefaccin. Si tengo el escritorio cerca de la puerta que tendra un gabinete justo detrs de donde estan  los lentes terminados y en espera. Esto tambin creara un espacio privada detrs del escritorio para el trabajador, tambin  podra tener un rea de interface en la esquina donde la recepcin era antes.\n\nViste e la sala de espera en ese enlace que te mostr?... la colocacin de esa vitrina bloquea el pasillo.\n\n- El rea de los nios  es de 3 ft de ancho en este momento. Adjunt un segundo archivo para ver ms fcil ver el rea de los nios (Archivo adjunto). Sobre esa pared, que es un rea independiente, no ha sido diseada aun , sin embargo, sera un rea de diversin como una cueva o  un lugar cerrado don de pueda encajar una televisin y  videojuegos. Estaba buscando en lnea reas de juegos para  nios, cerradas y cubiertas, y vi a una que era una mariposa grande y los nios pueden entrar a jugar, pero de todos modos, qu tan grande crees que deba ser?\n\n- Con respecto a la iluminacin sobre el escritorio de la recepcin, y el techo baja an ms, las lamparas colgantes de plata estn bien,  pero podemos mantenerlo simple?  as se vera que son colgantes.\n\n- Si tengo el escritorio cerca de la puerta, tendra un gabinete justo detrs de de donde estn los lentes terminados y en espera. Esto tambin creara un espacio privado detrs del escritorio para dar al trabajador un rea privada.\n\n- Me podras dar una idea de cunto tiempo tomara  el diseo 3D de la recepcin? en la parte delantera de la tienda con el gabinete detrs de l, que no sea muy alto para que la gente pueda ver ms all  de la iluminaron los gabinetes en el fondo.\n\n- Quiero dar algunas actualizaciones en general, despus de pensar en la zona de recepcin. Pienso que slo hay dos opciones principales ... puede ser colocado en frente del pasillo con un armario tipo de bffer detrs de el, aproximadamente 1ft de espesor y poder  del display principal ah, o  colocarlo en la esquina donde est ahora.\n\n\n\n\n\n***************************************\n\n\nI want to minimize the reception area space to maximize the retail. I want one area of the desk to be check out as people come up from the hallway one area to be check in (the front part). \n\nOne area along the wall to be where people can sit and pick up glasses.  the cieiling of the reception area is 10 ft high.\n\nThere is the wall separating the washroom from the kids area.\n\nI am moving the wiating area to teh front of the store, should allow for 4 chairs about, well a chair takes up 2ft about, we could place them 2 along the window, one facing one wall  one facing the other wall.\n\nwhat do you think of moving the reception desk to the front and it is the first tihng people see when they come in the door also then this would open up all the space behind the reception desk now to display glasses  bc behind reception is dead space right now except for storage which is important. how far back from the door you think should the reception be.\n\nIf i have the desk close to the door i would have a cabinet just behind where the finished glasses and done and waiting. this would also create a private space behind the desk to give the worker there some private area.\n\n\ni could have heat coming in from above the door as they come in that might solve the heat problem  if i have the desk close to the door i would have a cabinet just behind where the finished glasses and done and waiting.  this would also create a private space behind the desk to give the worker there some private area then i could hve he interface in the corner where the reception desk was before.\n\nWell the waiting area is at the front of the store just inside the window. u know like u ssee the waiting area on that link i showed u , the placement of that display case that blocks the hallway\n\nSo is the kids are about 3 ft wide now I loaded a second file up just so it is easier to see the kids play area. About that wall,  it is to be a self contained area,  it has not been designed yet,  but like a little fun area like a cave or some enclosed area  wanted to fit tv or video games in there. i was looking online for a kids play area enclosed and indoor, I saw one it was a big butterfly  and the kids went inside but anyway, how big an area are u picturing?\n\nRegarding the lights above the reception desk, and the ceiling coming down further,  the pendants would be silver but we can keep it simple  just show those pendants so we know they are pendants.\n\n\n\nCan you give me an idea on how long it would be for the 3d look of the reception desk at the front of the store with the cabinet behind it, not a high one so people can look past it to the look of the lit up cabinets in the background. \n\nI want to update in general after thinking about the reception area. I am thinking there are only two main options... it can be placed in front of the hallway with a buffer type cabinet behind it approx 1 ft thick and can get rid of that main display there or it can be placed in teh corner where it is now.','2013-04-10 11:12:45',NULL,'2013-04-10 11:12:45',NULL),
