  (2727,2678,2677,NULL,54,1,15,NULL,'2013-04-10 17:53:22','Slo estoy mirando brevemente y esta primera impresin es buena. Hay alguna forma que pueda hacer el color de la tapa del color original? el color de la tapa ha cambiado un poco, pero yo esperaba que se quede igual. ?\n\nHe adjuntado una imagen con algunas revisiones. Me gusta mucho el color antiguo.\n\nAqu hay un archivo con un hydracup y algunos granos de caf. No tena ningnas almendras. Tal vez esto pueda ayudar a proporcionar un realismo mejor.\n\nUna cosa ms, hay una lnea verde flotante, podria ser eliminado en la prxima actualizacin?\n\nHe aadido algunas actualizacines finales sobre la botella verde.\n\nDespus de mirar la taza roja con bananana. Los elementos de la taza y el lquido rojo son buenos, pero el pltano tiene que ser ms realista. Parece pixelada y digital. Si pudiera suavizarlas y tambin hacerlo ms amarillo, creo que sera de gran ayuda.\n\nSin embargo, la colocacin y el ngulo total de la banana es buena.\n\nLa bana se ve mejor. He aadido mis revisiones.\n\n********************************************\n\nI''m just briefly looking at this my first impression are the changes upfront are good. Is there anyway you can make the lid the old color? the lid color has somewhat changed but I was hoping it would stay the same. ?\n\nI''ll send this to my team and see what they say. I''ve attached an image with some revisions. I really like the old color better. \n\nHere is a file with a hydracup and some coffee beans. I didnt have any almonds. Maybe this can help to provide some more realism. Or just a reference.\n\nOne more thing there is a floating green line, can it be removed in the next update?\n\nI have added some final thoughts on the green bottle.\n\n\nAfter looking at the red cup with bananana. The elements of the cup and red liquid are good but the banana itself needs to look more realistic. It appears pixelated and digital. If it could be smoothed and also appear more yellow I think it would really help.\n\n\nHowever the placement and overall angle of the banna is good.\n\nBanana looks better.\n\nI have added my revisions.','2013-04-10 17:53:22',NULL,'2013-04-10 17:53:22',NULL),
