  (2764,2694,2693,NULL,54,1,12,NULL,'2013-04-16 12:40:12','Gracias por estos dibujos en 3D,  son muy buenos. Realmente me ayudan a poner las cosas en perspectiva.\n\nLa nica cosa por la que estoy preguntando es sobre si el escritorio se traslad a la parte delantera del pasillo?\n\nEstaba pensando si el escirtorio fue trasladado all, un armario con puertas podran estar detrs de l para poner el  los lentes terminados y listos para recoger. Podrias mover la mesa para delante de la pantalla de lentes que esta bloqueando el pasillo, despues, cambiar la pantalla apor un gabinete que albergara los trabajos hechos? El gabinete no tiene que ser ms que 1 pie de profundidad. Slo quiero saber como se ve.\n\nUn vistazo a esta oficina, me gustan algunos de los colores de all,  el plata maneja un  bonito color. podras cambiar los colgantes por los de plata? \n\nhttp://brassmonocle.com/about.html\n\nTambin, por supuesto, si la mesa se ??movi delante de pasillo, entonces habra ms espacio para  las ventas al por menor, se podran crear para pantallas ahi.\n\n\n*****************************************\n\nHI Sole thank you for these 3d drawings, they really are quite good. They really help me to put things in perspective as well. The one thing I am really wondering about is if that desk was moved to the front of the hallway. So if you picture where you have the screen with the glasses, if the desk was moved in front of that. As I recall I thought you were of the same mind that the reception desk would work best there. I was thinking if it was moved there a cabinet with doors could be behind it to house the glasses jobs that are finished and ready for pickup. ARe you able to move the desk to in front of the glasses screen that at the moment blocks the hallway, then change the screen to a cabinet that would house glasses jobs done? The cabinet does not have to be more than 1 ft in depth. I just want to see what that looks like.\n\n\nhave a look at this office. i like some of the colors there as well, the silver handles on the nice colored draws. could you change the pendants to silver ones? thanks so much for your great work, Lara\n\nalso of course if the desk was moved in front of hte hallway then more retail space could be created for glasses displays','2013-04-16 12:40:12',NULL,'2013-04-16 12:40:12',NULL),
