  (2787,2786,2786,NULL,48,6,14,'Comentarios del cliente','2013-04-23 11:17:56','Tenemos que trabajar en  nuestros newsletters. Cuando la gente va a los sitios, excelerol.com y matchadna.com, tienen la opcin de suscribirse a nuestro boletn y un libro electrnico gratuito. Todo esto funciona a travs de MailChimp.  Ya tenemos a alguien trabajando en MatchaDNA, por eso  necesitamos a alguien para Excelerol.\n\nActualmente tenemos trabajando 2 autorespuestas.\n\n1. Un mensaje de bienvenida con algo de informacin acerca de excelerol cerca de 2 das despues de de la inscripcin.\n\n2. Una carta de bienvenida con algo de informacin adicional sobre el t, 7 das despus.\n\nLo que nos falta es:\n\nQue cada 7 das por 32 semanas deben recibir un breve boletn con un video (desde nuestro sitio http://www.twogenius.com).\n\nNecesitamos que esto se haga en MailChimp. LOG-IN INFO - Mailchimp ingreso: accelintel contrasea $ $ Uccess000000\n\nHemos contratado a alguien para que haga una plantilla y es aceptable. Tambin hemos contratado a un escritor, pero su trabajo era insatisfactorio y necesita de revisin y limpieza.\n\nEsta es la tarea, necesito que armes 32 boletines de noticias a nuestro suscriptores de Excelerol. \n\nCada boletn debe tener un video, el artculo adjunto y algo de informacin escrita. Los ttulos de los boletines de noticias deben ser irresistibles (hay un montn de informacin en lnea sobre cmo escribir ttulos increbles). Un ejemplo podra ser:  \" Hey, Do you know about Chia Seeds and\nthe brain?\" ....Entonces habr un video en China y tambin el artculo anterior.\n\nLa mayor parte (99%) ya est hecho. Slo tienes que hacer la personalizacin.\n\nPuedes encontrar los videos aqu: \n\ntwogenius.com. \n\nCada video debe coincidir con cada tema del newsletter. Los videos son producidos por nosotros y se pueden encontrar en ese sitio.\n\nEcha un vistazo, necesito que ajustes el boletn a una vez por semana en MailChimp. Puedo darte nuestro login de  chimp,  la plantilla ya est diseada.\n\nSaludos,\n\n\n*************************************************\n\nWe need to work out our newsletter. When people go onto our sites, excelerol.com and matchadna.com , they have the option to sign up for our free newsletter and to get a free ebook. This all works through mailchimp.  We have someone working on MatchaDNA, so we need you for Excelerol.  \nCurrently we only have 2 auto responders working.\n1. They get a welcome email with some info about excelerol about 2 days from signing up.\n2. They get a welcome letter with some added info about our tea 7 days later.\nWhat we are missing:\nEach 7 days for 32 weeks they should get a cool,brief newsletter with an aweosme video (from our site http://www.twogenius.com .\nWe need this to be set up in MailChimp.  LOG-IN INFO -- Mailchimp Login : accelintel password : $$Uccess000000\n\nWe hired someone to do a template and it is acceptable. We hired a writer to write them but her work was subpar and needs review and cleanup.\n\n\nHere is the task, I need you to put together 32 newsletters to our Excelerol\nsubscribers.\n\nEach newsletter should have a video, the attached article and some well\nwritten information. The titles of the newsletters should be irresistible (\nthere is a lot of info online on how to write amazing email titles that\npeople open.).  An example might be \" Hey, Do you know about Chia Seeds and\nthe brain?\" Then there will be a video on China and the article above.\n\nMost of the copy (99%) is already done. You just need to do the\ncustomization.\n\nYou can find the videos here: twogenius.com . Each video should match each\nnewsletter topic. The videos are produced by us and can be found on that\nsite.\n\nTake a look and let me know if you think you can make some headway. I would\nneed you to just set them up as a once a week newsletter on mailchimp. Let\nme know and I can give you our mail chimp login, the template is already\ndesigned.\n\nThis email and its contents are confidential. If you are not the intended\nrecipient, please do not disclose or use the information within this email\nor its attachments. If you have received this email in error, please delete\nit immediately. Thank you.\n\nRegards,','2013-04-23 11:17:56',NULL,'2013-04-23 11:17:56',NULL),
