  (2816,2810,2802,NULL,54,1,12,NULL,'2013-05-06 09:42:18','Hola,\nLuce bien, solo algunos retoques:\n\nPodras hacer que se vea un poco ms corto, y deslizala hasta el tope contra la baranda?.......la baranda debe ser la pared posterior del kiosko.\n\nEl estilo esta bien, pero el background  esta un poco fuera de la realidad, el patio de comidas  debe estar mas all de las mesas y no delas tiendas.  Tambin  el angulo mirando desde  el interior del rea de la mesa hacia la parte posterior del kiosko debe ser un poco mas precisa  mostrando mas del suelo y las tiendas ....como en las fotos por favor.\n\nAcabo de notar algo.... este kiosko es para el otro lugar, es por eso que lo apartaste de la baranda, ya que bloqueara la nevera.., jaja...pero esta bien para el demo, solo dale la vuelta 180 grados y ponlo contra baranda.\n\nUsa este kiosko para la otra locacin, donde estaban los sofs en las fotos... en frente de la tienda CINZEO.\n\nGracias\n\n***************************************************************\n\nHI GUYS , \nTHAT LOOKS ABOUT RIGHT, JUST A FEW TWEAKS,\nCOULD YOU MAKE IT LOOK A BIT SHORTER, AND SLIDE IT TO BUTT UP AGAINST THE RAILING THE RAILING SHOULD BE THE BACK WALL OF THE KIOSK..\n\nTHE STYLE IS JUST RIGHT . BUT THE BACK GROUND IS JUST A BIT OFF FROM REALITY, THE FOOD COURT SHOULD BE BEYOND THE TABLES AND NOT STORES. ALSO THE ANGLE LOOKING FROM INSIDE THE TABLE AREA TOWARDS THE BACK OF THE KIOSK SHOULD BE A BIT MORE ACCURATE SHOWING MORE FLOOR AND THE STORES AS IN PIC PLEASE. \n\nTHERE IS ONE THISNG I JUST NOTICED--- THIS ENTIRE KIOSK IS THE ONE FOR THE OTHER LOCATION AND NOT DESIGNED FOR THE RAILING ARE, THAT WHY YO SLID AWAY FROM THE RAILING AS IT WOULD BLOCK THE FRIDGE AND TILL,, HAHA.. BUT ITS OKAY FOR THE DEMO HERE JUST SPIN IT AROUND 180 DEGREES AND PUT AGAINST THE RAILING. \n\nUSE THIS KIOSK AS IT IS FOR THE OTHER LOCATION WHERE THE COUCHES WHERE IN THE PICS INFRONT OF CINZEO STORE.','2013-05-06 09:42:18',NULL,'2013-05-06 09:42:18',NULL),
