  (2860,2852,2851,NULL,54,1,12,NULL,'2013-06-07 09:52:13','Las imgenes y el CAD se ven bien, sin embargo, no muestran nada diferente a lo que tengo ahora. Las imgenes JPEG y CAD necesitan mostrar el estante en 2 fases:\n\nLa primera fase es lo que ya hiciste, aunque a estas imgenes le faltan los muelles comprimidos en la parte trasera de cada plataforma, segn sea necesario. \n\nLa segunda fase necesita mostrar la estantera totalmente extendida hacia delante del display ( de manera que los estantes puedan salir hacia adelante como los cajones de un escritorio).\n\nEsto es lo que quera comunicar en la descripcin del trabajo, si no estaba claro, me disculpo. \n\nHe adjuntado 2 bocetos de lo que necesito.\n\nGracias\n\n************************************************\n\nThe images and CAD look good, however, they do not show anything different than what exists today. The jpeg images and CAD both need to show the rack in 2 phases. The first is what you have already created, though these images are missing compressed springs on the backside of each shelf as needed. The second imagine needs to show the shelving fully extended forward from the rack (the shelves will be able to roll forward much like the drawer of a desk). This is what I intended to communicate in the first 2 steps of the job description, if I did not make that clear I apologize. I have attached 2 rough sketches of what I need illustrated in hopes that it will help explain better.\n\nLet me know what you can do with it.\nThanks,\nMatt','2013-06-07 09:52:13',NULL,'2013-06-07 09:52:13',NULL),
