  (2868,2867,2867,NULL,46,1,14,'Brief directions:','2013-07-12 12:52:14','I need a rendering drawn of an area under a bridge (I have some rough dimensions) that will have a concert stage, scaffold setup, a dance floor, and lighting.\n\nI''ve attached a drawing of the site at the moment. I''m looking for you to redraw this in 3d and add a couple things to it. \n\nI have a few measurements here that you will need:\n\nbridge height from ground to underside of bridge 21''4\"\nthe width from one end of the underside of the bridge to the other 140''9\"\n\nHopefully from these measurements you are able to scale the rest of the drawing into place?\n\nThis is not for constrauction, so the details do not need to be 100% accurate.\n\n I''ll try and get you some photos, In vectorworks would be great.\n\nThanks','2013-07-12 15:34:48',NULL,'2013-07-12 12:52:14',NULL),
