  (2879,2878,2878,NULL,35,1,14,'Comentarios del cliente','2013-07-17 10:29:00','What we are designing is a new concept of mini supermarket that I expect to recycle and sell to different clients. It is therefore important to me that the first example is nice enough to convince others to follow.\nI am hoping to build sort of a toolbox that I can keep re-using. \n\nDelivery elements:\n\nElements that will be placed inside the supermarket (gondolas, fridges, freezers, bulk food dispensers, Counters, Vegetable stands, flower stands, etc....) should be extractable in Sketchup for example (or 3DS MAX) so they can be reused and placed again in another store design later on. That way I can save on design costs next time round.\n\nAs a final delivery I would therefore like to receive individual files for each element in an agreed software format.\n\nI own a copy of 3DS MAX myself so I will expect the final work to be delivered or uploaded somewhere for me to download so I can play it on my own machine.\n\nDetail level:\n\nOn shelves and inside fridges, I will expect to find realistic visuals of products. \nProduct categories represented are:\nCanned foods\nFrozen foods\nBeverages\nPersonal Care\nGum & Candy\nNuts & cereals\nBreakfast foods\nSnacks (Chips, Biscuits, Cereal bars)\nMilk\n\nThere will also be at the front counter a space for Ice-cream scooping, Coffee making, Bakery items (incl sandwiches) and a front counter with POS / Till and bagging area.\n\nThere will be a bulk foods display area, a Fresh Vegetable display area, and a cut flower stand outside the store.\n\nI would like to make sure we will get a realistically detailed level of visualization as I intend to wow my clients by the quality of the renderings.\n\nThis is the kind of realism and detail I need for this project.\n\nJust want to clarify that you will be able to create all the items I need.\n\nI will supply floor plans and will be able to tell you all the items I want and where they go. You will then have to models them either from a pic or a brochure and place them on the floor.\n\nI will be able to tell you how the shop is merchandised and where each item goes.\n\nWe have a week to do this so I expect to start quickly, I already have most of the items we need.\n\nThere should be about 3 rounds of changes so we can make sure everything pleases the client. I will schedule a first meeting in one week.\n\n\nthanks','2013-07-26 17:05:24',NULL,'2013-07-17 10:29:00',NULL),
