  (2881,2879,2878,NULL,46,1,15,NULL,'2013-07-18 11:13:59','Hacer varios modelos de\n1. Canned food (comida enlatada)\nhttp://indianapublicmedia.org/eartheats/files/2009/11/Canned_Foods.jpg\n2. Beverage\nSodas en lata, en bottela pequea, botella grande, cerveza en lata en boteela pequea y grande (corona si se puede).  y vinos.','2013-07-18 11:13:59',NULL,'2013-07-18 11:13:59',NULL),
  (2882,2879,2878,NULL,54,1,12,NULL,'2013-07-23 09:19:47','Here is the store address on Google Maps\n\nhttp://goo.gl/maps/XqmNm\n\nAnd here is a link to the dropbox folder where I have started saving the elements:\n\nhttps://www.dropbox.com/sh/5q4an6riebapq9g/KfV2QFGozz\n\nPlease log-in and check them out.','2013-07-23 09:19:47',NULL,'2013-07-23 09:19:47',NULL),
  (2883,2868,2867,NULL,35,1,15,NULL,'2013-07-23 11:43:34','Adjunto imagenes del landscape corregidas de noche, gracias\n\n saludos,\n\n Rommel','2013-07-23 11:43:34',NULL,'2013-07-23 11:43:34',NULL),
