  (2886,2879,2878,NULL,54,1,12,NULL,'2013-07-23 17:20:38','Some brief directions:\n\nI have included snapshots of Google maps and Bing maps from the Apple map interface. both show a slightly different angle in 3D\n\nThis is one of the shop we are working on. Actually there are 3 at the moment this is a slightly small er than originally discussed but its the one I care the most about because we actually own this one. I bought it in February and I want to redesign it completely, increase the business and sell it\n\nLike I explained while doing this I want to build a library of Sketchup and 3DS MAX elements so we can more easily do projects like this in the future.\n\nWe are still working on the brand of this store. It will be called CORNER JACK''S.  Now one thing you can''t see well in the plan is the openings in the wall on the garden side.\n\nSo on the floor plan there is a room to the right hand side where you can see two ice-cream freezers and one deli bakery cabinet.\n\nIn front of the ice cream freezers I want to cut an opening and put a metal roller door so people can order from outside. Here is the link to the Roller door I have been looking at buying so you can model it. \n\nhttp://tuoman.en.alibaba.com/product/518900086-212684958/High_security_metal_roller_shutter_door.html?edm_src=sys&edm_type=fdbk&edm_grp=0&edm_cta=read_msg&edm_time=realtime&edm_ver=e\n\nI also want to cut another opening in front of the Deli Bakery cabinet with the same roller door.\n\nIn the garden I want to put a long pergola where people can sit covered and enjoy ice-creams, teas, coffees and snacks even if the weather is a little colder. Under the Pergola I want Outdoor gas heaters.\n\nThe problem of this business today is that it works well only in summer.\n\nBy adding coffee / bakery and opening more to the garden side - I add a coffee shop / bakery business to the existing Convenience store and Ice Cream business. The aerial shots should give you a good idea of the garden.\n\nNo problem. Over the Ice-Cream serving area and at the back in front of the Deli Cabinet I need a Veranda that is covered so people can pick up and buy without getting rain. And I think we can build a low deck / terrasse in wood as they do here in NZ. this is a website of a NZ designer who does decking terrasses.\n\nhttp://www.eboss.co.nz/library/outdure\n\nInside the store, when you see Shelves that are on the wall what I actually want is slat wall panels where I can organise shelves in different ways. like this:\n\nhttp://www.ndstorefixture.com/Slatwall_Sheets_p/2999.htm\n\nThe fridges you have already in the folder - we will use only a combination of SK650 and SK1000. And freezers are this one:\n\nhttp://www.liebherr.com/HGG/en-GB/region-IL/products_hgg.wfw/id-691556-0_24730-0\n\nAs for the things that go on the shelves and in the fridges I have a list in the folder foods.\n\nStart modelling the elements in team 2 first please. The other team is doing team 1 and we will share so we can save time. no point having two teams doing the same thing.\n\nEach element should be saved back on dropbox please. So I can start making that library I need.\n\nThen we will concentrate on the front desk.\n\nThank you','2013-07-23 17:20:38',NULL,'2013-07-23 17:20:38',NULL),
