  (2890,2879,2878,NULL,54,1,12,NULL,'2013-07-24 18:05:10','position wise I think so but the elements you placed have the wrong height. maybe it would be easier to directly place some of the elements I have given you. For example you already have the gondolas in sketch up format in the folder, also the fridges SKS650 and SK1000 (choose a couple of SK1000 and 3x SK650 if it fits... fit as many as you can in the length)\n\nand I uploaded yesterday a freezer brochure on the folder for Ice Cream scooping.\n\nI have tried to draw the pergola outside the way I saw it,  I uploaded my sketch.\n\nthere needs to be a roof so it doesn''t rain under but I see the front a little large and high maybe with louvres as a design...like this but horizontal:\n\nhttp://www.eboss.co.nz/library/louvretec/180-louvreline-weatherboard-panel\n\nSee how the outside of the Nosh store is made:\n\nhttp://www.stuff.co.nz/auckland/local-news/5800221/Nosh-food-market-enters-new-deal\n\nthe Nosh brand on the left is on some wood panel slats... well I want that slat effect a bit like louvres.\nTimber is fine or aluminium depends on your design ... I don''t really mind. Timber might be cheaper to make.\nAs an example I really like the outdoor design of this store and that is what inspires me. If I could remodel the outside of our store matching this style a bit without copying too much that would be great.\n\nin terms of elements in the food preparation area. I have this benctop food preparation counter that normally is used for pizza. They come in different sizes. See :\n\nhttp://itopkitchen.en.alibaba.com/product/572296100-213514728/air_cooled_refrigerated_pizza_counters_with_displayer.html\n\n ITOP is the company we will source all the appliances from. The other food station could be this one with the juicer and the slushy machine on top. \n\nhttp://itopkitchen.en.alibaba.com/product/572428022-213514728/Depth_600mm_3_doors_stainless_steel_refrigerated_snack_counters.html\n\nand a blender as well please:\n\nhttp://itopkitchen.en.alibaba.com/product/640069824-214301642/Traditional_electric_commercial_power_blender.html\n\njuicer next to it:\n\nhttp://image.made-in-china.com/2f0j00mevaMPsnyfbj/Centrifugal-Juicer-XC-JP200-XC-JP100-.jpg\n\nA slushy machine:\n\nhttp://kingkongpartyrentals.com/images/concessions/double_bowl_margarita_slushie_machine/kingkongpartyrentals_double_bowl_margarita_slushie_machine_front.jpg\n\nIf you can save all the sketch up elements you are creating for the inside in the dropbox folder please\ngreat,\n\nThanks','2013-07-24 18:05:10',NULL,'2013-07-24 18:05:10',NULL),
