  (2893,2892,2892,NULL,46,1,14,'Comentarios del cliente','2013-07-25 09:26:27','Hello\n\nI need a realistic drawing of a cart. I am attaching the cart to show you what I need.\n\nIt has to be drawn without anything in it and with products in it.\n\nI need two images. The carts are acrylic and metal. The picture I sent you gives and Idea of the two carts sided by side. I just want one with stuff in and one without.\n\nI also want a up closed illustration of two section showing how they load, fall to the botton of the section, and unload. \n\nThanks','2013-07-25 17:43:25',NULL,'2013-07-25 09:26:27',NULL),
