  (2897,2753,2752,NULL,54,1,12,NULL,'2013-07-25 17:12:56','Comentarios del cliente:\n\n- in side-by-side.pdf  \n\ni would like the trees behind he sign to be more similar to the trees in the photo.  Also World Health sign is missing on the building.  \n\n- in side by side 1.pdf\n\nshows the first draft on the top and then we had asked for the tree to be removed but what happened was somehow the orientation of the sign was changed...\nso the sign is facing the wrong way in this view and should be facing the direction on the top image in side by side 1 and not the bottom image.\n\nthe modification-with-photoshop file... shows i took it into photoshop and had to change the logo for world health as the one provided in the renderings looks incorrect - the color is wrong - it looks skewed and distorted.\nso i''m wondering if we can make the sign look more professional and real... so that I don''t have to edit it in photoshop as its hard to edit the other angles.\n\nCould you also remove the schoolbus and put in a nicer vehicle please .\n\nalso the world health panel is supposed to be 6'' heigh and the digital panel is 12'' 7\"  and the lower panel looks to be quite high so I just wanted to ensure that the ratio is right.\n\nAttached is  a real sign that is up and running\n\nThe dimensions are different in the world health one  in the real photo i just sent the sign is 30''X12.5'' (top) and 7.5''X30'' (bottom) in the world health rendering the sign is 25.5''X12.6'' (top) and 6''X25.5'' (bottom)  and the middle band is only 1 foot.\n\nThanks','2013-07-25 17:12:56',NULL,'2013-07-25 17:12:56',NULL),
