  (2904,2879,2878,NULL,54,1,12,NULL,'2013-07-25 17:18:49','Regarding screenshots:\n\n\nI think the left window of the shop front is larger than the space we will have. Because inside we are going to put fridges against the wall... It will block a part of that window maybe.\n\nyou''ll have to adjust once you get a good feel for the inside the pergola outside extension is too wide. I agree it should run along the whole garden length but thinner. not as wide as the building\nand maybe more positioned towards the back of the garden against the tree hedges  sea side.\n\notherwise the rest is nice\nJust to clarify when we are under the pergola on the shop side I can see thru but there is a roof there right ? I should not be able to see thru over the roller doors.\n\nthanks','2013-07-25 17:18:49',NULL,'2013-07-25 17:18:49',NULL),
