  (2910,2909,2909,NULL,46,1,14,'Brief directions:','2013-07-26 16:49:32','Goal: to give prospective client a bit more of the feeling of what their space would look like AFTER the proposed renovation.\n\nI have developed a very basic plan for a 4-story row house (1st Floor Tenant; 3-Floor Triplex). My prospective client doesn''t understand volume, so rendering a 3-d tour of the place would be very helpful. Ideally, I''d like to create a visual representation of the space that shows off the volume a bit more (maybe a 3-d tour of the space) so that I can walk my client through it, so that they can get a perspective that they understand. I would expect that once I show them the space, they would want to make changes. I have no preference on software for this sort of thing, only that revisions/adds will be easy for the future - ideally, revisions that I could make, but worst case that you would make. \n\nPhase 1: digital floorplans of the 4 floorplans I sent you (I do not have these files digitally, just the PDFs). Because I do not have exact measurements for this phase, I would want you to approximate size based on scale drawings I sent you, using generic furniture/flooring/etc. I can send you supportive material (similar sample rooms) and/or label the type of style that we''re going for, but don''t need to be exact. This is meant to give my client a slightly more clear view of the floorplans. \n\nPhase 2 would be exact measurements/specifications and actual materiality choices of the same floor plans. Here I would want 3d floorplans. \n\nPhase 3 would be final material choices and any edit/measurement changes. The output I would want from this phase would be 3d renderings.\n\nThanks','2013-07-26 18:25:25',NULL,'2013-07-26 16:49:32',NULL),
  (2911,2910,2909,NULL,54,1,16,'44_Monroe_Tenant_Space.pdf','2013-07-26 16:49:32',NULL,'2013-07-26 16:49:32',NULL,'2013-07-26 16:49:32',NULL),
