  (2917,2879,2878,NULL,54,1,12,NULL,'2013-07-26 18:38:01','The side window is actually a door by the way, you know next to the scooping freezers on the left ... that''s a door to get inside the shop...\n\none thing  that google map doesn''t capture well is the new picket fence around the garden...and unfortunately they have given us a phone booth .... god know who still uses those... but its there also and I can''t change that one..\n\nso if you can make the side window into a door and allow the decking to reach (now it has plants) we should be fine like that. Tables and chairs I am not sure off as at the moment we have timber ones but they are on a concrete pad... in the grass they will dig in... not practical..','2013-07-26 18:38:01',NULL,'2013-07-26 18:38:01',NULL),
  (2918,2879,2878,NULL,46,1,15,NULL,'2013-07-26 20:07:58','Rommel: \n1. hay que agregar una reja de madera blanca que hay alrededor del jardin.\n2. La cabina telefonica.\n3. Los huecos laterales son hasta abajo (son puertas como la seccion de helados de globos).\n4. las sillas del jardin que sean de madera y proponer poner algo en el piso del jardin. No quieren las mesas y sillas directamente sobre el pasto','2013-07-26 20:07:58',NULL,'2013-07-26 20:07:58',NULL),
