  (2927,2879,2878,NULL,54,1,12,NULL,'2013-07-29 09:34:30','See attached your spreadsheet updated with info where to find the elements.\n\nThe last outdoor pic is very good. Thanks\n\nJust a few points:\n1. The phone booth is more to the left. Please check aerial pics on google street view. It is at the start of the picket fence\n2. The first window in the shop front. I think once you layout inside you will realise it is in front of fridges so it needs to be slightly to the right hand side so you can fit a fridge agains the wall without blocking the window.\n3. Freezers need to be aligned with the windows space / but once again I think that will get fixed once you do the layout of the inside.\n\nTalk soon, let me know if anything is unclear','2013-07-29 09:34:30',NULL,'2013-07-29 09:34:30',NULL),
