  (3057,3056,3056,NULL,46,1,14,'Instrucciones','2013-08-07 17:59:59','We are in the beginning stage of building a custom single-family house, approximately 8000 square feet on a lot of about 3 acres. 2 acres out the 3 are marked as restricted area which means no part of the house should touch that area, but driveway and landscape are OK. Due to its odd shape of the usable area and steep slope, making it functional as well as impressively beautiful has become a real challenge.\n\nHere are the design requirements:\n1. Must understand the topo map, attached, and know what kind of land you are working with.\n2. The house can be any styles as long as it gives great curb impression on the first look in the front. Your direct comparison (or competition) is the house next door which is a 9000 square feet European mixed style.\n3. The house should not touch the restricted area, but you can have deck or overhang.\n4. You may have multiple floors and you should make the most out the 180-degree view available.\n5. You may include at least 4-car garage, swimming pool and any landscaping ideas.','2013-08-07 17:59:59',NULL,'2013-08-07 17:59:59',NULL),
