  (3064,3063,3063,NULL,46,1,14,'Frozen store, offices and industries','2013-08-09 10:09:02','Necesitamos hacer vistas interiores.\n1. 3D rendering of a self serve yogurt store like http://www.tcbysparta.com/\n\thttps://www.google.com/search?q=self+serve+yogurt+store+design&source=lnms&tbm=isch&sa=X&ei=yx8DUpaII4OoiQL1-4CABw&sqi=2&ved=0CAcQ_AUoAQ&biw=1152&bih=538#bav=on.2,or.r_cp.r_qf.&fp=28e704bf6ba40454&q=tcby+self+serve&sa=1&tbm=isch&facrc=_&imgdii=_&imgrc=ocC36zZ8tnSXIM%3A%3BltcOTd7geBc_bM%3Bhttp%253A%252F%252Fwww.graphicology.com%252Fstorage%252Farticle-images-3%252Ftcby_2.jpg%253F__SQUARESPACE_CACHEVERSION%253D1276153645572%3Bhttp%253A%252F%252Fwww.graphicology.com%252Fblog%252F2010%252F6%252F10%252F298-tcbys-new-logo-just-the-jimmies-on-the-top.html%3B520%3B350\n\n2. 3D rendering of Kiosk like\n\thttp://www.menchiesfranchise.com/frozen-yogurt-messages-from-ceo.php?view=3\n3. 3D rendering of Food Truck - \n4. 3D rendering of our Yogurt Machines inside a high end \n\tRestaurant\n\tGas Station\n\tConvenience store\n\tBakery\n\tCoffee Shop \n\tSmoothies Shop','2013-08-09 10:09:02',NULL,'2013-08-09 10:09:02',NULL),
