  (3079,3078,3078,NULL,54,1,14,'BRIEF DIRECTIONS:','2013-08-12 12:29:02','Two full color artist renderings.\n\nLooking for a \"wow\" factor.\n\nMust fit 32\" long x 36\" high\n\nWe like a very \"realistic\" look like what you''ve shown in your file named 3D_Edificio_14.\n\nI have attached the link to our \"dropbox\" which holds the Sketchup file. Compare to the PDF file I previously sent you to determine the correct rendering (I am unable to open the sketchup as I do not have that program - came from our architect - so I do not know if it will be useful to you).\n\nhttps://www.dropbox.com/s/lk8jq28s5om7tg1/lele%20front.skp\n\nWe need the two renderings I previously sent.... the PAGE 2 rendering, is the view of our building from the perspective of standing in the water - so this is the one that will need beach/water/sand added as well as the Cabana''s with beach umbrellas (about ten cabanas/umbrellas total).\n\nLastly - I am going to provide you with my Skype name, should you have any questions or need to discuss anything please do not hesitate to contact me.\n\nOnly need two renderings. Both Day time with clouds and all that good stuff.\n\nTHANKS','2013-08-12 12:29:02',NULL,'2013-08-12 12:29:02',NULL),
  (3080,3079,3078,NULL,54,1,12,NULL,'2013-08-12 12:32:44','Additionally -\n\nI ''d like to provide you with additional information about our location so that it may make it easier to do the rendering. A couple things to bear in mind when looking at the pictures/video''s I''m enclosing..\n\n1. The project that is shown is not currently existing, nor will it - its purely the location/views.\nThe link immediately below, is as if you are standing at the back of the building, looking at the beach... bridge to your left (east), Gulf of Mexico to the right (west) - its a South View:\n\n\nhttp://enchantmentresidences.com/residences/views/gen_9_S.html\n\n2. The attachment - the building in the picture is currently here but will be demolished to build the building in the renderings - but gives you a better idea of what our location looks like.\n\n\nOur address (if you desire to google it and see the actual location) is\n\n\n691 S. Gulfview Blvd.\nClearwater Beach, FL 33767\n\nOur beach, is the only private beach on the whole island of Clearwater Beach.\n\nRemember - The building currently on the property is being demolished to build the buildings in the renderings we''ve requested from you.\n\nLastly - I called a printing company locally and they said the best quality for them to print is 300DPI and in the format of PDF.\n\nThank you!','2013-08-12 12:32:44',NULL,'2013-08-12 12:32:44',NULL),
  (3081,3079,3078,NULL,54,1,12,NULL,'2013-08-12 12:33:42','The only pictures we have are the renderings we provided to you. Unfortunately because this building does not yet exist, we cannot take pictures of it. If you Google \"Green Walls\" that''s the idea, its a mix of panels of green glass with other panels of green vegetation. I will do what I can to obtain a better idea for texture, etc.','2013-08-12 12:33:42',NULL,'2013-08-12 12:33:42',NULL),
  (3082,3079,3078,NULL,54,1,12,NULL,'2013-08-12 12:34:40','Comentario reciente!!\n\nI had our architects take a look at the rendering you provided us on Friday (just to make sure that the rendering is in line with their original idea when creating the building) Their comments/responses are pasted below  I left their comments exactly as they put them as you are also in the business of architecture so I feel direct is best for the clearest understanding between all parties.\n\nI feel like youve done a fantastic job thus far, the building looks very realistic. Please take into account their comments and make the adjustments as best as possible  as far as sky coloring  despite the comments, we do still want 2 day renderings and one evening. I look forward to hearing back from you with your comments as well.\n\nJordan (lead architect)\n- Don''t like the grey glass\n- Shadows are wrong and not creating drama\n- Blue sky blends with blue forms a little too much, try a more evening sky color\n- Glass at rails also aren''t quite right\n\nDavid (supporting architect)\nAlong with Jordan''s comments, the rendering looks too much like an elevation. If the view was rotated to the left it would be a bit more dramatic and show more depth. The water being so green (though true to this area) is distracting and a little unattractive.\n\nThanks','2013-08-12 12:34:40',NULL,'2013-08-12 12:34:40',NULL),
