  (3137,3136,3136,NULL,46,1,14,'panel to post','2013-09-30 12:02:01','1. resolucion de 2000 px de ancho.\n2. Este proyecto es para mostrar a la gente como se conectan las rejas con los postes.\n3. Las funciones basicas:\na) insertas las rieles\nb) se insertan en los huecos de los postes.\nc) Se aseguran con tornillos de acero al poste.\n4. Asegurarse de mostrar en detalle la punta de la reja. Ya hicimos esta punta en las rejas que hicimos antes.\n\n\n1. I want it BIGGER than the attached picture.\n2. This PROJECT is solely to show our customers how you CONNECT our fence panels to our posts. \n3. The basic function is: a) you INSERT the rails b) into pre-punched holes in the posts (we always punch the posts based upon the panel) and c) then you SET the connection be self-tapping stainless steel screws through the post AND INTO THE RAIL inside the post.\n4. Make sure you show the detailed Designer Spear. Remember, you did these on our panel/gate diagrams.\n\nI want you to make YOUR version larger than the original (attached).\nI want a clean, sharp, bold picture re-do. I want the panel to look strong, sharp. I want little dotted lines showing that the screws would actually be drilled... similar to the attached photo EXCEPT I want it re-done and looking great. Don''t forget a nice GF watermark. Please give me a price estimate so we can move forward on this.','2013-09-30 12:02:01',NULL,'2013-09-30 12:02:01',NULL),
  (3138,3137,3136,NULL,46,1,16,'Panel_To_Post_diagram.jpg','2013-09-30 12:02:01',NULL,'2013-09-30 12:02:01',NULL,'2013-09-30 12:02:01',NULL),
