  (85,9,'32','Esta resuelto el problema.',1,'2012-07-11 14:50:10'),
  (93,9,'44','ADEMAS QUE SE HAGA UNA CONVERSION A CARATERES HTML (Para que se respeten saltos de linea y caracteres especiales)',46,'2012-07-11 16:12:19'),
  (94,9,'44','1.Cambiar el titulo de la pagina de FORUM a FORO.\n2. Quitar la descripcin del foro cuando vemos la lista de TEMAS. Osea en esta pagina: http://cocomanager.com//forums/topics/?topic_id=44&forum_id=2\n3. Reducir el espacio entre POSTS',46,'2012-07-11 16:56:26'),
  (95,9,'44','Estan resueltos todas las observaciones anteriores, menos la de CARACTERES ESPECIALES, ese un problema generado por CODEIGNITER.',1,'2012-07-11 17:46:41'),
  (96,9,'44','Ya esta resuelto tambien el problema de los caracteres especiales, se ha cambiado en la configuracion de codeigniter.',1,'2012-07-11 18:22:04');
